INSERT INTO `biz_article` VALUES (97, 4, '第一届亚洲古生物学大会暨中国古生物学会90周年纪念活动在北京隆重举行', '11月18-19日，为期两天的第一届亚洲古生物学会大会暨中国古生物学会成立90周年纪念活动在北京中国科技会堂隆重举行。大会期间，举行了中国古生物学会90周年华诞纪念系列活动，包括纪念大会开幕式、中国古生物学会90周年纪念短片和系列图书发布，颁发中国古生物学会终身成就荣誉，特邀国际专家学术报告、书刊展览展示、亚洲古生物学协会筹备以及天演之夜欢迎会等系列活动。 \n\n　　\n', NULL, '2019-12-15 02:24:40', 'admin', 1, 270, 2, 1, 'https://jnwq-land-pub-test.oss-cn-beijing.aliyuncs.com/jlncwqw/pkgs/dev//uploadWPS.png?Expires=1981002609&OSSAccessKeyId=UjyKDL1Jo24Z6TCm&Signature=5MA8fhQzhqlRPQq6cje%2F8AHzcAY%3D');
INSERT INTO `biz_article` VALUES (99, 4, '周志炎陈旭获中国古生物学会终身成就荣誉', '11月18日，第一届亚洲古生物学大会暨中国古生物学会成立90周年纪念活动在中国科技会堂隆重召开。会上，中国古生物学会向八位年逾八旬的古生物学院士授予了终身成就荣誉。中国科学院南京地质古生物研究所周志炎院士、陈旭院士获此殊荣。 \n\n　　正如中国科学院副院长丁仲礼在书面致辞中指出，古生物学是地质学的一门“小学科”，但是它在探秘地球漫长演变历史和追索生命起源演化方面，是一门不可或缺的“大学科”。在老一辈中国地质学家和古生物学家的努力下，中国古生物学会已成为目前中国自然科学中历史悠久、影响深远、成就显著的学术共同体之一，在世界古生物学界也占有十分重要的地位。为表彰和感谢老一辈地质学家和古生物学家对中国地质学与古生物学的贡献，值此九十周年华诞之际，中国古生物学会向张弥曼、汪品先、殷鸿福、周志炎、吴新智、郑守仪、陈旭、邱占祥等八位年逾八十周岁的古生物学院士授予了“中国古生物学会终身成就荣誉”。', NULL, '2019-12-15 02:38:44', 'admin', 1, 278, 2, 0, 'https://jnwq-land-pub-test.oss-cn-beijing.aliyuncs.com/jlncwqw/pkgs/dev//upload1665645846656.jpg?Expires=1981005867&OSSAccessKeyId=UjyKDL1Jo24Z6TCm&Signature=cTbMX7MGxolwxg2uR%2FIEWGaLDSA%3D');
INSERT INTO `biz_article` VALUES (100, 4, '【人民日报】亚洲古生物协会总部落户南京', '第一届亚洲古生物学大会暨中国古生物学会成立90周年纪念活动日前在北京举行。会议期间，来自亚洲10余个国家的古生物学会代表就正式成立“亚洲古生物协会”召开第一次工作会议，决定该协会总部落户中国。\n\n　　据介绍，新成立的亚洲古生物协会总部设在中国古生物学会所在地南京，对于发挥中国古生物学的区域性国际学术影响力具有重要意义，也将有助于“一带一路”沿线国家开展国际合作。\n\n　　当天，中国古生物学会还授予张弥曼、汪品先、殷鸿福、周志炎、吴新智、郑守仪、陈旭、邱占祥等8位年逾八旬的院士终身成就荣誉。\n\n　　据了解，本次大会为期3天，设立10个专题论坛，并安排10个大会特邀报告、70余个口头学术报告和70余个展板报告。', NULL, '2019-12-15 02:41:39', 'admin', 1, 87, 2, 0, '47800ba5-33e8-42a4-b69d-f9866f7e3e7e.jpg');
INSERT INTO `biz_article` VALUES (101, 4, '南京古生物所与泰国玛哈沙拉堪大学签订合作备忘录', '2019年11月19日，在北京参加第一届亚洲古生物学大会暨中国古生物学会成立90周年纪念活动期间，泰国玛哈沙拉堪大学（Mahasarakham University）代表团一行7人应邀与中国科学院南京地质古生物研究所所长詹仁斌以及研究所科研和管理人员代表进行了座谈交流。期间，南京古生物所党委副书记、纪委书记蔡华伟与玛哈沙拉堪大学古生物研究和教育中心主任Mongkol Udchachon博士分别代表双方签署了合作备忘录。 \n\n　　会谈期间，双方就感兴趣的合作领域进行了深入交流，探讨了拓展合作的途径和形式，并就双方人员交流、联合野外、人才培养、科研项目合作及联合承办国际会议等未来合作意向达成多项共识。 ', NULL, '2019-12-15 02:42:26', 'admin', 1, 88, 2, 0, '31e0ac3c-f882-4fb3-8262-c252426384c4.jpg');
INSERT INTO `biz_article` VALUES (102, 4, '南京古生物所两项工作获中科院国际合作局通报表扬', '11月19日，中国科学院2019年度国际化发展工作会议在京召开，中科院院长、党组书记白春礼出席并讲话。会上，中国科学院国际合作局对近三年国际化推进重点工作表现出的先进单位予以了通报表扬。经量化统计和综合评估，中国科学院南京地质古生物研究所获评“中科院国际人才计划管理先进单位”（排名第三）和“国际科学传播工作先进单位”（排名第六）两项荣誉。 \n\n　　十八大以来，中国科学院实施国际化推进战略，积极优化国际合作支撑保障环境，加速拓展全球科技合作网络，显著提升全球创新资源使用能力，深度参与全球科技创新治理，不断增强在全球科技创新中的领导力，全院国际合作水平上了一个新台阶，在助力“四个率先”方面发挥了重要作用。 ', NULL, '2019-12-15 02:44:13', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (103, 4, '南京古生物所召开安全工作会议', '9月30日下午，中国科学院南京地质古生物研究所召开安全工作会议。南京古生物所所长詹仁斌，党委书记、副所长杨涛，党委副书记、纪委书记蔡华伟以及各部门负责人和安全员等参加了会议。会议由杨涛主持。 \n\n　　会议传达了近期中科院、江苏省下发转发的系列有关安全工作通知精神，并就进一步完善研究所应急预案等工作进行了交流，要求各部门针对本部门岗位特点制定完善相应的应急预案。 \n\n　　杨涛和蔡华伟分别就国庆节期间园区安全、网络安全、研究生安全以及新安装显示屏使用安全等事宜进行了重点强调和部署。 \n\n　　会议最后，詹仁斌重点强调三个方面：一是继续高度重视安全工作，各部门要结合此次建国70周年大庆为契机，深入做好安全工作；二是持续提高防范意识，要树立大安全观，全策全力做好安全工作；三是进一步梳理和排解各种安全隐患和苗头，特别是实验室、博物馆以及食堂等区域，确保不出现任何安全问题。 ', NULL, '2019-12-15 02:45:04', 'admin', 1, 89, 2, 0, 'd8512825-87b9-45cf-a439-ce42a777665e.jpg');
INSERT INTO `biz_article` VALUES (104, 4, '南京古生物所举办老同志集体生日会', '<p>10月31日，中国科学院南京地质古生物研究所组织为今年适逢80岁寿辰的15位老同志和90岁寿辰的2位老同志举办集体生日会。南京古生物所长詹仁斌、党委书记杨涛参加活动。 詹仁斌和杨涛代表党政领导班子向老同志们致以诚挚的问候和生日祝福，祝福各位老前辈生日快乐、健康长寿，并送上生日贺卡。老寿星们见面格外高兴，个个神采奕奕，大家互相问候，幸福之情溢于言表，他们畅谈幸福的退休生活，现场气氛热闹、其乐融融。参加生日会的老同志们齐唱生日祝福歌，戴着寿星帽合手许愿，两位90岁的寿星，代表大家吹蜡烛，将本次生日会推向高潮。 老寿星们对研究所的关心表示感谢，大家一致表示要将晚年生活活出健康、活出精彩，期盼下一次相会。莫道桑榆晚，落霞尚满天！</p>', NULL, '2019-12-15 02:50:54', 'admin', 1, 202, 2, 0, 'ca1757ae-73e4-46e1-8925-9a4f116d8d77.jpg');
INSERT INTO `biz_article` VALUES (105, 4, 'IGCP 679项目2019年国际学术研讨会在青岛召开', '<p>2019年10月11-17日，国际地学计划IGCP 679项目“白垩纪地球动力学和亚洲古气候”第一届国际学术研讨会在山东青岛举行。会议由中国科学院南京地质古生物研究所主办，山东省地质调查院、山东科技大学地球科学与工程学院承办，青岛地质工程勘查院协办。本次会议包括2天室内学术报告和交流，以及为期3天的会前野外地质考察。</p>', NULL, '2019-12-15 02:52:11', 'admin', 1, 201, 2, 0, 'f000ec35-bd00-4590-aa00-8d14dc3ff383.jpg');
INSERT INTO `biz_article` VALUES (106, 5, '中国古生物学会孢粉学分会学术年会在绵阳召开', '为庆祝中国古生物学会孢粉学分会成立40周年暨中国古生物学会成立90周年，充分展示和总结中国孢粉学各领域近年来所取得的各项研究进展，促进学术交流和学科发展，2019年10月11日至13日，中国古生物学会孢粉学分会在四川省绵阳市召开了第十届第二次学术年会及理事会议。会议得到了广大会员的积极回应，共有64家单位202位代表参加了会议。\n\n    本次会议共收到了论文摘要129篇、学术报告115个（其中口头89个，展板26个）。本次会议报告内容丰富，除传统的地层孢粉、第四纪植被和环境、考古、表土花粉与植被重建、孢粉形态、植硅体等方向之外，还涉及了花粉营养、DNA、昆虫与传粉关系等领域，体现了我国孢粉学的可喜发展和综合实力。中国孢粉学现有从业人员500余人，学科方向齐全而多样。孢粉学分会自1979年成立以来，采取各种措施加强和推动中国孢粉学的学科建设、人才成长和成果产出，在国际科学前沿、服务国民经济建设和满足人民美好生活需要等方面都做出了有力的贡献。', NULL, '2019-12-15 02:56:11', 'admin', 1, 274, 2, 0, 'https://jnwq-land-pub-test.oss-cn-beijing.aliyuncs.com/jlncwqw/pkgs/dev//upload1665645501278.jpg?Expires=1981005529&OSSAccessKeyId=UjyKDL1Jo24Z6TCm&Signature=VamCIELUMb7%2FDTNsEQel%2FsltVa4%3D');
INSERT INTO `biz_article` VALUES (107, 5, '王贺博士获得中国科学院院长优秀奖', '中国科学院2019年度院长奖评审结果日前揭晓，中国科学院南京地质古生物研究所王贺博士获得本年度中国科学院院长优秀奖。 \n\n　　中国科学院院长奖是研究生奖学金中含金量最高的奖项之一。王贺在南京古生物所研究生学习期间，与研究团队成员合作发表论文23篇，包括一篇Nature子刊和一篇Science子刊，分别报道了一个新的晚白垩世琥珀生物群和我国中晚三叠世昆虫生物群大辐射，其中以第一作者身份发表SCI论文11篇。 ', NULL, '2019-12-15 02:58:27', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (108, 5, '南京古生物所组织参观“共产党人的初心与使命”档案文献展', '为教育引导广大党员干部在党史中汲取奋斗力量，切实肩负起时代使命，8月20日上午，中国科学院南京地质古生物研究所按照“不忘初心、牢记使命”主题教育要求，创新学习教育载体，组织在宁党委委员、纪委委员、支部书记、支委、各部门领导和团员青年代表赴中国第二历史档案馆参观“共产党人的初心与使命”档案文献展。 \n\n　　大家依次参观了“民族危亡”“同舟共济”“星星之火”“中流砥柱”“历史选择”5个单元的展览。一页页珍贵的文献资料，一张张泛黄的照片，记载着中国革命的峥嵘岁月，让大家深刻地认识到是历史和人民选择了马克思主义，选择了中国共产党，切身感受到中国共产党近百年来付出了巨大牺牲而不忘初心，团结带领全国人民不懈奋斗的光辉历程。 ', NULL, '2019-12-15 02:59:10', 'admin', 1, 97, 2, 0, '028053c7-cd50-4005-af8b-8aa260814452.jpg');
INSERT INTO `biz_article` VALUES (109, 5, '南京古生物所科学家参加第11届北美古生物学大会', '2019年6月23-27日，第11届北美古生物学大会（11th North American Paleontological Convention）在美国加州大学河滨分校举办，来自全球34个国家的六百余位专家学者参加了此次会议。中国科学院南京地质古生物研究所彭善池研究员、王鑫研究员、陈哲研究员、赵方臣研究员、梁昆博士、李启剑博士、季承博士、那琳博士、方翔博士、曾晗博士、赵涛博士及多位研究生参加了本次会议，并分别作口头报告介绍相关研究领域的最新进展，得到了国际同行的普遍认可和积极评价。', NULL, '2019-12-15 03:00:30', 'admin', 1, 98, 2, 0, '7e96f867-06e2-441e-b25a-cab025e4de33.jpg');
INSERT INTO `biz_article` VALUES (110, 5, '中海油渤海石油研究院勘探所调研地层古生物咨询中心', '7月12日，应中国科学院南京地质古生物研究所地层古生物咨询中心邀请，中国海油（中国）有限公司天津分公司渤海石油研究院勘探研究所副所长、勘探地质首席工程师王德英及中海油实验中心相关代表来宁考察调研，并与南京古生物所相关专家进行座谈交流。南京古生物所副所长王军主持座谈。 \n\n　　座谈会上，咨询中心唐鹏副主任首先就南京古生物所研究方向、人才队伍、支撑平台及近年的科研成果等方面做了简要阐述。他着重就现代古生物学与地层学在油气资源勘探中的应用现状及前景进行了介绍，特别是精细地层划分对比、多途径的综合地层学研究及地层古生物大数据在油气资源勘探中可以发挥的重要作用；最后，他介绍了咨询中心的定位、工作方向及在服务国民经济主战场方面所做的贡献。随后，王贺助理研究员作了莱州湾第四纪介形类研究的学术报告。', NULL, '2019-12-15 03:01:00', 'admin', 1, 99, 2, 0, '150be5e6-aa53-496f-9950-bf0201bb379d.jpg');
INSERT INTO `biz_article` VALUES (111, 6, '六亿年前的化石揭示动物起源之谜', '<p>动物（特指后生动物，即包括最简单的海绵动物到最复杂的脊椎动物在内的所有多细胞动物）无疑是整个地球生态系统中不可或缺的组成。作为动物界的成员，人们对动物究竟是何时并如何起源的抱有天然的好奇心，但直到今天，这仍然是演化生物学领域悬而未决的重大科学难题。 　　  </p><p><br></p><p>　　现代动物界包括三十多个动物门类，已有研究表明它们拥有一个距今大约7亿多年的共同祖先。这一共同祖先由多细胞组成，而且细胞有功能分化，它是由更古老的单细胞祖先演化而来。然而，动物单细胞祖先是何时以及如何演化成多细胞祖先的呢？这个问题一直没有确凿的答案。 　　  </p>', NULL, '2019-12-15 03:03:56', 'admin', 1, 101, 2, 0, 'b883c239-a1d2-47bf-9470-b98d2dd3bcdc.jpg');
INSERT INTO `biz_article` VALUES (112, 6, '白垩纪缅甸琥珀中发现最早的有花植物昆虫传粉证据', '<p>我们人类的大部分食物来自被子植物（开花植物），而90％以上的被子植物需要昆虫授粉。如此重要的授粉行为是什么时候开始在地球上出现的呢？中国科学院南京地质古生物研究所科研人员在缅甸琥珀中的新发现，为最早的被子植物虫媒传粉提供了直接证据。相关研究于2019年11月12日在线发表在《美国科学院院报》（PNAS）。 </p><p><br></p><p>　　被子植物（有花植物）是当今最繁盛的植物类群。化石记录显示被子植物在白垩纪中期突然大量出现。达尔文将这一“反常现象”称为“讨厌之谜”。许多被子植物通过昆虫进行传粉（虫媒传粉），从而促进基因流动，形成高度的多样性。因此，昆虫传粉被认为是白垩纪中期被子植物大爆发的一个关键因素。尽管白垩纪中期昆虫和被子植物的种类已经较为丰富，但此时期被子植物虫媒传粉的直接证据却一直缺失。 </p>', NULL, '2019-12-15 03:05:26', 'admin', 1, 103, 2, 0, 'af198d58-8436-4443-8d6e-916e87d75e2f.jpg');
INSERT INTO `biz_article` VALUES (113, 6, '五亿年前化石揭示蝎子蜘蛛等螯肢类动物起源', '螯肢动物是包括蝎子、蜘蛛、蜱螨和鲎等在内的超过11.5万个物种的庞大节肢动物类群，对于寒武纪大爆发期间该类群动物是否已经起源一直不是很清楚。近日，中国科学院南京地质古生物研究所朱茂炎课题组法国籍博士后塞德里克·阿里亚（Cedric Aria）和加拿大安大略皇家博物馆同行合作，在寒武纪中期布尔吉斯页岩动物群中发现了一种莫里森虫（Mollisonia plenovenatrix）新物种，代表了目前已知最古老的螯肢类节肢动物。这项研究将包括螯肢动物的起源时间提前到了5亿年前。相关发现于2019年9月11日在线发表于国际著名科学期刊《自然》（Nature）杂志。', NULL, '2019-12-15 03:06:38', 'admin', 1, 106, 2, 0, '36337286-01fa-47dc-8745-44432dc23750.jpg');
INSERT INTO `biz_article` VALUES (114, 6, '早期动物演化的研究取得新进展', '长期以来，中国科学院南京地质古生物研究所和美国弗吉尼亚理工大学古生物学家团结合作，在早期生命研究领域取得了一系列的重要成果。最近，他们在动物的早期行为和早期海绵骨针的生物矿化方面又取得了新的进展，两项成果分别发表在Geology和Nature Communications上。 \n\n　　早期动物的行为受氧气控制 \n\n　　地球化学证据表明埃迪卡拉纪末期（551～539百万年前）海水经历了广泛的缺氧和剧烈的氧化还原条件的变化，这一变化直接影响动物的分布和行为。然而，通过化石反映这种变化的研究几乎没有。 \n\n　　近日，南京古生物所早期生命研究团队袁训来研究员、陈哲研究员、周传明研究员与弗吉尼亚理工大学肖书海教授合作研究，在Geology杂志上发表了题目为“Surfing in and on microbial mats: Oxygen-related behavior of a terminal Ediacaran bilaterian animal” 文章，认为早期动物的行为受海水中氧气含量的控制。 ', NULL, '2019-12-15 03:08:28', 'admin', 1, 108, 2, 0, 'd61f47ce-eb6a-421d-b3a6-a41c4798e129.jpg');
INSERT INTO `biz_article` VALUES (115, 6, '《华南泥盆纪古生态系统与古环境》专辑出版', '<p><img src=\"https://jnwq-land-pub-test.oss-cn-beijing.aliyuncs.com/jlncwqw/pkgs/dev//uploadQQ%E5%9B%BE%E7%89%8720191211181601.jpg?Expires=1982714367&amp;OSSAccessKeyId=UjyKDL1Jo24Z6TCm&amp;Signature=bj0nvy%2FIn28q440GduRlfR57ym0%3D\"></p><p>由中国科学院南京地质古生物研究所郄文昆副研究员、梁昆助理研究员和德国法兰克福Senckenberg研究中心Peter Konigshof博士联合主编的《华南泥盆纪古生态系统与古环境》专辑最近在Springer出版社的国际刊物《Palaeobiodiversity and Palaeoenvironments》正式出版。这是对近年来我国泥盆纪古生物和古生态研究进展的一次综合整理和系统总结，内容涵盖华南泥盆纪各个阶段的重要生物类群，包括竹节石、腕足类、牙形类、床板珊瑚、介形类和菊石类等，涉及系统古生物学、古生物地理学和古生态学等研究领域的最新进展。 </p>', NULL, '2019-12-15 03:09:57', 'admin', 1, 271, 2, 0, 'https://jnwq-land-pub-test.oss-cn-beijing.aliyuncs.com/jlncwqw/pkgs/dev//upload1665645018510.jpg?Expires=1981005044&OSSAccessKeyId=UjyKDL1Jo24Z6TCm&Signature=6XLZHE7EZasIuZxQaz7MjytLE0c%3D');
INSERT INTO `biz_article` VALUES (116, 6, '头足类古生物地理学研究揭示中–晚奥陶世板块漂移', '奥陶纪时中国的大部分板块都位于冈瓦纳东北缘的低纬度热带地区，包括华南、华北、塔里木、喜马拉雅、拉萨、滇缅马苏（保山地区），这些板块的古地理位置以及在奥陶纪时的漂移历程一直是研究热点。 \n\n　　近日，中国科学院南京地质古生物研究所早古生代研究团队方翔博士、张元动研究员等人，联合澳大利亚塔斯马尼亚大学Clive Burrett教授，通过对冈瓦纳东北缘多个地区中、晚奥陶世头足类动物群的研究对比，利用多种定量古生物地理学手段，识别了该地区两个时间段不同的头足类生物地理区系模式，为冈瓦纳大陆东北缘地区古板块恢复重建提供了重要的古生物学依据。 ', NULL, '2019-12-15 03:10:51', 'admin', 1, 273, 2, 0, 'https://jnwq-land-pub-test.oss-cn-beijing.aliyuncs.com/jlncwqw/pkgs/dev//upload1665645276560.jpg?Expires=1981005298&OSSAccessKeyId=UjyKDL1Jo24Z6TCm&Signature=Qs2KehQiTo8nb44qicrwh371PgQ%3D');
INSERT INTO `biz_article` VALUES (117, 6, '缅甸琥珀揭示甲虫高度特化的捕食行为', '昆虫纲是自然界中生物多样性最为丰富的类群，而隐翅虫科（鞘翅目）是昆虫中多样性最高的一个庞杂类群，分为32个现生亚科，已描述的种类大约70,000种。目前隐翅虫化石的研究主要集中于探讨它们形态特征的演化，而对某些隐翅虫特殊行为的演化历史知之甚少。 \n\n　　近日，中国科学院南京地质古生物研究所蔡晨阳研究团队通过对缅甸琥珀中大量的隐翅虫化石进行系统研究，发现了两种突眼隐翅虫化石。它们极其罕见地保存了高度特化的捕食器官，揭示了突眼隐翅虫捕食行为的早期演化，并对理解现代的突眼隐翅虫亚科内各个属的系统关系和捕食行为的起源具有重要意义。该研究于2019年2月18日在线发表于美国《当代生物学》（Current Biology）上。 ', NULL, '2019-12-15 03:15:52', 'admin', 1, 115, 2, 0, '8c04e057-f0a6-476e-8291-f0c83fcca29e.jpg');
INSERT INTO `biz_article` VALUES (118, 6, '缅甸琥珀中发现树蕨类和水龙骨类植物新类群', '在植物界中，蕨类植物作为植物演化进程中的一个关键类群，是植物系统发育、大尺度宏演化过程及生态环境和气候变化的直接“见证者”。在现代植物中，蕨类植物作为种子植物的姊妹群，是构建“生命之树（tree of the life）”系统工程、研究陆生植物起源演化的一个关键类群。然而，由于蕨类植物的主体为草本类群，很难保存为化石，而包含繁殖器官（即孢子囊和孢子）的化石更为罕见，所以对蕨类植物诸多类群的研究和认识还比较有限，许多问题尚未解决和澄清（如起源时间、祖先类群、演化辐射方式和系统发育关系等）。　　  ', NULL, '2019-12-15 03:17:50', 'admin', 1, 117, 2, 0, '8ed55b1e-fbdb-4532-bdbd-9a34fe38b94b.jpg');
INSERT INTO `biz_article` VALUES (119, 6, '中新世佛昙生物群的高精度年代学分析', '福建漳浦的佛昙群地层产出了大量动植物化石及琥珀，构建了我国中新世的热带雨林生态系统，统称为佛昙生物群。佛昙生物群中丰富而精美的植物化石保存在硅藻土和泥岩中，而地层下部煤层和砂岩层中产出了大量的琥珀。鉴于此，对于该生物群精确的年代学研究显得极为重要。 ', NULL, '2019-12-15 03:18:50', 'admin', 1, 119, 2, 0, '5fe1380c-7cb5-423d-95e7-9bcde7a5dc3a.jpg');
INSERT INTO `biz_article` VALUES (120, 6, '介形类揭示晚泥盆世F-F事件灭绝模式', '晚泥盆世弗拉期（Frasnian）-法门期（Famennian）生物环境事件（F-F事件）不仅造成生物多样性大幅度下跌，还给生态系统带来了重创，被认为是显生宙五次生物大灭绝事件之一。 \n\n　　介形类（Ostracoda）是节肢动物门甲壳纲的一个亚纲，自早奥陶世一直繁盛至今。介形类时空分布的广泛性和对环境响应的敏感性、独特性，使之成为探讨生物与环境过程的重要研究载体。虽然从二十世纪八十年代起古生物学家就对F-F之交的介形类进行研究，但关于F-F事件对介形类的影响及其灭绝模式仍存在许多分歧。 ', NULL, '2019-12-15 03:19:19', 'admin', 1, 122, 2, 0, '523c1c4e-1bf9-4cc1-85bf-d0b9eac68e93.jpg');
