INSERT INTO `biz_article` VALUES (130, 6, '有孔虫研究揭示拉萨地块晚二叠世时独立于南羌塘和喜马拉雅', '青藏高原由多个板块拼合而成，地质构造背景十分复杂。地质历史时期各个板块地理位置存在较大差异，这也造就了各个板块动物群面貌的特殊性，二叠纪动物群及其古生物地理已被证明是推断西藏各个地块的古地理位置的有效手段。 \n\n　　拉萨地块的上二叠统长期以来被认为是含植物的陆相地层，因而认为拉萨地块晚二叠世已隆升为陆。但近年来陆续在拉萨地块报道了晚二叠世的海相地层，对传统观点形成了挑战。然而，这些海相地层中的动物群及其古生物地理缺乏系统研究。 ', NULL, '2019-12-15 03:44:56', 'admin', 1, 129, 2, 0, '423982d9-20bc-453d-8aea-a778ca3a1396.jpg');
INSERT INTO `biz_article` VALUES (131, 6, '缅甸琥珀中发现真双子叶植物静子花', '百四十年前，达尔文对于被子植物在白垩纪中期突然大量的出现百思不得其解，因为按照他的理论，一切类群都应该有一个从少到多的发展过程，显然被子植物的突然大量出现对他来说是个难以解释的“讨厌之谜”。 \n\n　　经过了上百年的研究，人们发现在达尔文所关注的时代之前的早白垩世甚至侏罗纪都有被子植物，被子植物的起源时间应当更早。既然被子植物起源不在那个世代，那么困扰当年困扰达尔文的到底是什么现象？ ', NULL, '2019-12-15 03:46:36', 'admin', 1, 131, 2, 1, 'a2399538-ece3-4379-b1aa-7a14fd577359.jpg');
INSERT INTO `biz_article` VALUES (132, 7, '研究成果简介', '<p>建所以来，本所在国内外科学刊物上发表论文8000余篇、各种科技专著380余册；在古生物分类研究中，建立1500多个新属，12000多个新种。自1956年以来有200余项科研成果获得国家、中国科学院及省部级奖励，其中27项获国家级奖励。特别是近年来，本所在早期生命起源和寒武纪大爆发、重大地史时期生物的辐射、灭绝与复苏、全球界线层型、早期植物的起源与演化等领域获得了一系列国际著名的研究成果。</p>', NULL, '2019-12-15 03:59:51', 'admin', 1, 275, 2, 0, 'https://jnwq-land-pub-test.oss-cn-beijing.aliyuncs.com/jlncwqw/pkgs/dev//upload1665382814664.png?Expires=1981005564&OSSAccessKeyId=UjyKDL1Jo24Z6TCm&Signature=I%2BRf1%2FFTguPc0StRCR421wXXh%2FY%3D');
INSERT INTO `biz_article` VALUES (133, 7, '重点研究方向', '★ 重大地史时期生物的起源、辐射、灭绝与复苏\n\n以生物演化为主线，结合环境演变，由老到新，探讨若干重要生物类群的起源、大规模适应辐射、灭绝、复苏的型式和特征，探索生物演化与环境变迁的关系，力争在生物演化理论的研究方面有所创新。\n\n★ 地球早期生命的起源、辐射和演化\n\n前寒武纪的生物演化历史约占整个地球生命史的七分之六，其间发生了一系列生命演化的“里程碑”事件。如，46-35亿年间生命的起源和原始生态系统的建立；25亿年左右氧化大气圈的形成和真核生物的出现；中元古代至新元古代多细胞动物和多细胞植物的起源、早期辐射以及复杂生态系统的建立和演化。这些地球早期生命的演化革新事件需要多学科的交叉研究，以期探索和认识它们发生的时间、过程和环境背景等。', NULL, '2019-12-15 04:01:54', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (134, 7, '中国的大戟科花粉形态学研究取得新进展', '<p>近期，中国科学院南京地质古生物研究所毛礼米研究员、中国地质调查局青岛海洋地质研究所杨士雄副研究员、中山大学郑卓教授等合作研究了中国南方地区大戟科（4亚科21属34种）花粉形态类型，为化石花粉分析补充了重要的参考与现代对比资料。该成果“Pollen atlas for the selected subfamilies of Euphorbiaceae from southern China: a complementary contribution to Quaternary pollen analysis”在线发表于AASP The Palynological Society的期刊Palynology。 </p>', NULL, '2019-12-15 04:02:49', 'admin', 1, 133, 2, 0, 'https://jnwq-land-pub-test.oss-cn-beijing.aliyuncs.com/jlncwqw/pkgs/dev//uploadWPS.png?Expires=1980645141&OSSAccessKeyId=UjyKDL1Jo24Z6TCm&Signature=8vwGn%2FvYE0lP1ly6Jfrc2upJiMs%3D');
INSERT INTO `biz_article` VALUES (135, 7, '琥珀菊石解密1亿年前海滨森林生态环境', '琥珀是远古植物的树脂经过长久的地质作用形成的化石。琥珀常常含有保存很好的陆地生物，例如花、微生物、昆虫甚至蜥蜴和鸟类。由于产生条件和保存环境的限制，琥珀很少保存水生生物，海洋生物更是凤毛麟角，而水生生物化石常常能提供关键的生态环境信息。这些远古的生态环境信息为我们了解未来陆地生态系统的变化提供了重要参考。 \n\n　　中国科学院南京地质古生物研究所“现代陆地生态系统起源与早期演化研究团队”的博士生俞婷婷在王博研究员和张海春研究员指导下，与牟林博士等人合作，报道了保存在一枚缅甸琥珀中的菊石、螺类、节肢动物等化石集群。综合化石生物群和埋藏学分析结果，表明该琥珀森林位于热带海滨地区，环境类似于当今的一些热带海岸森林。该研究为缅甸琥珀年龄提供了直接证据，并为琥珀埋藏学和白垩纪森林生态环境分析提供了新见解。该研究于5月14日在线发表于《美国科学院院报》（PNAS）上。 ', NULL, '2019-12-15 04:07:03', 'admin', 1, 135, 2, 0, '7d355f42-9b18-4a9f-b8fd-a0e0298f6d3d.jpg');
INSERT INTO `biz_article` VALUES (136, 7, '塔里木寒武纪蒸发岩研究发现硫同位素异常事件', '新元古代晚期到寒武纪早期是地球环境与生命演化的关键转折时期，整个生物圈、大气圈和水圈都发生了巨大的变化。该时期海水中硫酸根的硫同位素发生了剧烈的改变，其过程也被硫酸盐沉积记录了下来。 \n\n　　新元古代冰期之后，海水硫酸根的硫同位素显示出地质历史上的最大正异常。δ34S的数值在30‰至35‰之间波动，有时甚至可以达到45‰。该现象最早发现于西伯利亚的Yudomski地层，被称为Yudomski事件。  \n\n　　近期，中国科学院南京地质古生物研究所孟凡巍副研究员与中石化、中石油以及美国密苏里大学等单位的有关专家合作，对塔里木盆地的寒武系石膏沉积进行了分析，首次在塔里木盆地的寒武纪早—中期地层中发现了该异常事件，这也是国内对该事件的首次系统性研究。 ', NULL, '2019-12-15 04:08:17', 'admin', 1, 136, 2, 0, '636c69db-ae36-47ea-b821-c0e3c509b776.jpg');
INSERT INTO `biz_article` VALUES (137, 26, '学术沙龙通知（10月18日上午）', '报告题目：Big Data AI Driven Geology and Paleontology Scientific Research \n\n报告人：陈剑秦 加拿大埃森哲信息技术服务公司 \n\n时间：2019年10月18日（周五）上午9:00-10:00 \n\n地点：图书馆三楼报告厅 \n\n主办：国重、科技处、人教处 ', NULL, '2019-12-15 04:11:29', 'admin', 1, 276, 2, 0, 'https://jnwq-land-pub-test.oss-cn-beijing.aliyuncs.com/jlncwqw/pkgs/dev//upload1665645584060.jpg?Expires=1981005599&OSSAccessKeyId=UjyKDL1Jo24Z6TCm&Signature=A27hZu6nJaaiaYUt6VDRshNS3II%3D');
INSERT INTO `biz_article` VALUES (138, 26, '古生物演化与古环境系列讲座（10月16-18日）', '0月16日：上午10:00-12:00 \n\n　　1. Introduction: Geography, geology and paleontology of Japan  \n\n　　2. Early evolution of Metazoa: Molecular and fossil evidence  \n\n10月17日：上午10:00-12：00　　\n\n　　3. Mass extinctions (periodicity, end Permian and end Cretaceous)\n\n　　4. Mesozoic marine and terrestrial revolution ', NULL, '2019-12-15 04:12:52', 'admin', 1, 139, 2, 0, 'ed4906b7-b783-44ac-8ea9-5f31e06bc4a1.jpg');
INSERT INTO `biz_article` VALUES (139, 26, '地学大数据与人工智能国际研讨会暨第四届GBDB专题讲座通知', '一、会议背景和主题\n　　自上世纪80年代以来，数据库与各种定量分析方法在地球科学领域的应用日益增多，并带来了地球科学众多学科的变革性发展，一些新的研究方向、研究手段不断涌现，地球科学所研究的范畴也不断向更广更深的领域拓展。最近20年，随着人类迈入大数据时代，大数据、人工智能、虚拟现实等技术的不断发展与完善，基于海量数据的、区域或全球尺度的、定量化精细化研究在国际上日益普及，并且在理论和实践方面上都迅速发展，进一步推动了地学研究的这次重大变革。 \n\n　　为了保持与国际地学研究前沿同步，就必须了解其进程，把握其动向，进而实现突破。为实现这一目标，及时、准确并周期性地将国内外的先进理念和优秀技术方法等系统性地介绍到国内，无疑是一个非常有效的途径。故而，我们定期组织国内外相关学科和领域的科学家，针对国际间地球科学的新理论、新观点、新方法，开展开放式的学术交流和综合性的学术研讨，内容涉及多学科、多领域和多层次，并对一些相关的热点问题进行剖析。 ', NULL, '2019-12-15 04:15:21', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (140, 26, '达尔文大讲堂第九讲《鸟的前世今生》通知', '主要内容】鸟儿是人类的朋友，它带给我们欢歌，带来喜悦，让我们感受大自然和生命的美好！可你是否想过，天上飞翔的鸟儿是什么时候成为地球动物界的一员，它的祖先是谁？自上世纪九十年代以来，在我国辽宁等发现的大量带羽毛的恐龙解开了这一旷世之谜。原来，我们已经熟知的恐龙家族中的一支小型兽脚类恐龙就是当今鸟儿的祖先。那么，为什么这么说呢？本次讲堂将由季强博士为大家揭示其中的奥妙。 ', NULL, '2019-12-15 04:18:31', 'admin', 1, 140, 2, 0, 'acca5da2-014a-4141-b9b5-21e5a66e043b.png');
INSERT INTO `biz_article` VALUES (141, 26, '国重科学大讲坛（2月16日）', '编辑正文内容', NULL, '2019-12-15 04:20:51', 'admin', 1, 141, 2, 0, 'c6fde3a3-da13-41a9-8fd8-097ad3cb0f70.jpg');
INSERT INTO `biz_article` VALUES (142, 9, '南京古生物所召开“两学一做”学习教育专题推进会', '时值七月，一年过半，南京古生物所“两学一做”学习教育业已完成了前两个专题的学习，为总结前期各支部的特色工作，进一步深入推动“两学一做”学习教育，7月29日，南京古生物所党委再次召开专题推进会。在宁的党委委员、纪委委员以及党支部书记参加了会议。会议由南京古生物所党委书记王海峰主持。 \n\n　　王海峰传达了中科院党建工作领导小组办公室《关于召开“以学促做”党支部工作交流会的预通知》精神，强调各支部书记要切实安排好时间，确保准时参加交流会；希望能进一步凝练支部在开展“两学一做”学习教育中的特色工作以及通过学习教育迸发出的促进科研发展的典型案例，切实把各支部在开展学习教育过程两结合、两促进的成果展现出来。 ', NULL, '2019-12-15 04:26:19', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (143, 9, '樊隽轩应邀访问英国地质调查局', '英国地质调查局（British Geological Survey，BGS）成立于1835年，是世界上第一个国家地质调查局，其总部位于英国英格兰诺丁汉郡凯沃斯。在近200年的历史中，英国地质调查局积累了全球数百万的化石材料，以及数万的剖面和钻井数据。进入二十一世纪，作为一个公共组织，英国地质调查局希望推动这些重要资料的数字化和开放获取，从而吸引更多的用户使用其数据资源。 ', NULL, '2019-12-15 04:27:07', 'admin', 1, 142, 2, 0, 'f92521b2-62e6-489c-8cfc-9554ffb9c405.jpg');
INSERT INTO `biz_article` VALUES (144, 9, '南京古生物所召开“两学一做”学习教育系列推进会', '为不断深入推进南京古生物所“两学一做”学习教育，进一步贯彻落实好江苏省委“两学一做”学习教育工作推进会精神，充分发挥党支部的主体作用，切实将学习教育落到实处，9月9日下午，南京古生物所党委召开“两学一做”学习教育系列推进会。在所的党委委员、在职职工党支部以及研究生党支部书记参加了会议，会议由党委书记王海峰主持。 \n\n　　王海峰向大家传达了科研院所学习教育专题会议精神，强调要进一步把思想和行动统一到中央要求和省委部署上来，要进一步抓住重点深化举措扎实推进学习教育。王书记强调，各支部书记要进一步加强责任意识，抓好本支部的学习教育，切实按照中科院、江苏省委、南京古生物所以及本支部的学习计划开展好学习教育，同时，党委委员要进一步贯彻落实好联系制度，全程参与、指导好所联系支部的学习教育。 ', NULL, '2019-12-15 04:27:58', 'admin', 1, 143, 2, 0, 'aeb7c47a-2fe1-416b-95e4-6fbc267c53de.jpg');
INSERT INTO `biz_article` VALUES (145, 10, '李启剑赴德国访问并参加TERSANE项目研讨会', '7月13日-8月8日，中国科学院南京地质古生物研究所李启剑博士应邀赴德国埃尔朗根-纽伦堡大学（Friedrich-Alexander-Universität Erlangen-Nürnberg）进行访问合作。期间与该校的Axel Munnecke教授就华南志留系韩家店组下部小型点礁的沉积学和古生态学等方面进行合作研究，并完成相关论文初稿的撰写。同时，还与Axel Munnecke教授共同完成了塔里木中奥陶统一间房组礁灰岩有关文稿的最终修改并重新提交，此论文目前已经被国际刊物《三古》（Palaeogeography, Palaeoclimatology, Palaeoecology）正式接收并在线发表。另外，为定量评估奥陶-志留纪之交礁生态系统的详细变化，李启剑博士还与埃尔朗根-纽伦堡大学的Wolfgang Kiessling教授进行了深入探讨，在全球挑选了奥陶-志留系之交15个研究程度较高的案例进行生态梯度分析，获得比较满意的初步研究结果，为下阶段合作打下了基础。', NULL, '2019-12-15 04:30:40', 'admin', 1, 144, 2, 0, '50cfd0f5-3f14-4b9f-bf0a-f8ade60ec244.jpg');
INSERT INTO `biz_article` VALUES (146, 10, '南京古生物所召开内部控制规范工作专题推进会', '8月29日，南京古生物所召开研究所内部控制规范工作专题推进会。南京古生物所所长杨群、党委书记王海峰、副所长詹仁斌以及各职能部门负责人、财务主管等参加会议。会议由杨群主持。 \n\n　　财政部《行政事业单位内部控制规范》通过制定制度、实施措施和执行程序，实现对行政事业单位经济活动风险的防范和管控，对于提高单位管理水平，改进公共服务的质量和效率，规范财经秩序，加强廉政风险防控体系建设，营造风清气正工作环境，都具有十分重要的意义。 \n\n　　根据《中国科学院条件保障与财务局关于转发<财政部关于开展行政事业单位内部控制基础性评价工作的通知>的通知》，会议按照财政部《行政事业单位内部控制基础性评价指标评分表》及填表说明，逐条梳理研究所相关工作，认真总结评估，拟定内控工作推进方案，分解工作内容并落实到具体部门实施，以期通过此次评估完善研究所内部控制体系建设，进一步提升研究所管理水平。 \n\n', NULL, '2019-12-15 04:31:18', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (147, 10, '南京古生物所科学家赴澳大利亚参加大洋洲古生物学大会', '7月10日-15日，南京古生物所孙卫国研究员、朱茂炎研究员、周传明研究员、陈哲研究员、李国祥研究员等一行12人参加了在澳大利亚阿得莱德召开的大洋洲古生物学大会。此次会议是自2000年以来，大洋洲古生物学家协会时隔16年来主办的第二次学术大会。 \n\n　　本次会议由大洋洲古生物学家协会主办，国际地层委员会埃迪卡拉系分会（ISES）、寒武系分会（ISCS）和IGCP587项目协办，南澳博物馆和阿得莱德大学共同承办。除来自大洋洲澳大利亚和新西兰的代表外，来自中国、美国、加拿大、英国、法国、瑞典、俄罗斯、意大利、西班牙、丹麦、波兰、巴基斯坦等14个国家的200多位代表参加了大会。', NULL, '2019-12-15 04:32:19', 'admin', 1, 146, 2, 0, 'c71e163f-6827-4412-9842-d43fa62fad87.jpg');
INSERT INTO `biz_article` VALUES (148, 11, '江苏省科普场馆协会地质资源专委会会议在南京举办', '10月28日，江苏省科普场馆协会地质资源专委会第三次会议在南京古生物所举办。江苏省科协原副主席、江苏省科普场馆协会理事长吴国彬，以及来自南京古生物博物馆、南京地质博物馆、土壤博物馆、中华恐龙博物馆、盱眙地质博物馆、徐州矿业大学地质博物馆的委员单位及协会秘书处的代表参加了会议。南京古生物所詹仁斌副所长向与会人员表示了欢迎，并简要介绍了研究所的历史和科普工作情况。', NULL, '2019-12-15 04:33:20', 'admin', 1, 147, 2, 0, 'd8f0ae12-bcbe-4b0e-9abb-b527b2589315.jpg');
INSERT INTO `biz_article` VALUES (149, 11, '《远古的辉煌——生物大辐射》正式出版', '近日，由南京古生物所戎嘉余院士主编，冯伟民研究员、傅强副研究员、许汉奎研究员等编著的科普图书《远古的辉煌——生物大辐射》正式出版。本书是“远古生命的探索”丛书系列之一，也是业已出版的《远古的灾难——生物大灭绝》的姐妹篇。\n\n　　此次出版的《远古的辉煌——生物大辐射》一书集中系统地介绍了地球生命自38亿年前诞生之后所经历的极其漫长的演化历程，重点记述了在这个伟大历程中生命诞生和不同等级、不同规模的生物辐射事件，包括若干次无比恢宏、具有全球意义的大辐射事件。距今约20亿年前的地球大氧化作用，导致了真核生命的出现，使得生物的多样性第一次获得快速的发展。而第二次大氧化作用，迎来了多细胞后生生物的大发展，并在寒武纪呈现了爆发式的大辐射。5.42亿年以来，显生宙出现了三个演化生物群，引领地球生物群不断向前发展。寒武纪演化生物群，奠定了现代生物门类的整体框架和多样性发展的基础。而奥陶纪演化生物群引领了古生代生物群的发展。由于二叠纪末生物大灭绝，颠覆了古生代演化生物群，取而代之的是中新生代演化生物群。 ', NULL, '2019-12-15 04:34:50', 'admin', 1, 148, 2, 0, 'de4c3e45-a08c-48d8-9bc5-d3c2a97fb48d.jpg');
INSERT INTO `biz_article` VALUES (150, 11, '黄迪颖入选“万人计划”科技创新领军人才', '日前，中共中央组织部办公厅印发《关于第二批国家“万人计划”领军人才入选名单的通知》，全国共有620名科技创新领军人才和336名科技创业领军人才入选。南京古生物所黄迪颖研究员入选“万人计划”科技创新领军人才。\n\n　　“国家高层次人才特殊支持计划”（简称“万人计划”），主要是指围绕建设创新型国家的战略部署，面向国内高层次人才，用10年左右时间，有计划、有重点地遴选支持一批自然科学、工程技术和哲学社会科学领域的杰出人才、领军人才和青年拔尖人才，形成与“千人计划”相互衔接的高层次创新创业人才队伍建设体系。', NULL, '2019-12-15 04:35:31', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (151, 12, '第三届全国地质古生物科普研讨会在重庆举行', '2016年9月10日至11日，由中国古生物学会科普工作委员会主办，重庆自然博物馆、南京古生物博物馆承办的“第三届全国地质古生物科普研讨会”在重庆自然博物馆隆重举行。来自中国古生物学会科普工作委员会全体委员及所属单位人员，自然类博物馆、地质博物馆、古生物博物馆、国家地质公园、相关文化产业公司和科技出版界的负责人及有关人员，科普宣传的媒体人员等160余人参加了研讨会。 ', NULL, '2019-12-15 04:36:18', 'admin', 1, 149, 2, 0, '69bbb200-5244-425d-bf5c-2a6dc076f866.jpg');
INSERT INTO `biz_article` VALUES (152, 12, '早古生代团队成员赴湖北宜昌地区野外地质考察', '11月19日至11月23日，中国科学院南京地质古生物研究所早古生代创新研究群体成员詹仁斌、梁艳及研究生栾晓聪等赴湖北宜昌一带开展野外工作，重点关注该区下、中奥陶统的发育情况，主要涉及剖面包括宜昌界岭剖面、远安真金剖面和兴山古洞口剖面，此外，还对中奥陶统大坪阶金钉子——黄花场剖面以及上奥陶统赫南特阶金钉子——王家湾剖面进行了考察。\n\n　　宜昌一带奥陶系地层发育良好，具有扎实的研究基础。此次野外重新观察了古洞口剖面所发育的南津关组、分乡组、红花园组、大湾组及牯牛潭组下部，并进行几丁虫、岩石等样品的系统采集；对界岭和真金剖面所发育的庙坡组，进行几丁虫样品的系统采集及部分牙形类样品的补充采集。\n\n　　本次野外在前人工作基础上，对经典剖面和重点层位进行了更详细的测量和采样，后续室内工作将进一步揭示几丁虫等生物在奥陶纪生物大辐射进程中的表现型式及其环境背景和控制机制。', NULL, '2019-12-15 04:43:55', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (153, 12, '早古生代团队成员赴黔北地质考察', '10月30日至11月7日，中国科学院南京地质古生物研究所早古生代创新研究群体成员王光旭及研究生栾晓聪和张雨晨赴黔北石阡、湄潭、桐梓一带开展野外工作，对石阡奥陶-志留系界线地层进行了广泛踏勘，对湄潭、桐梓部分关键层位进行了重点采集。\n\n　　石阡一带地处奥陶-志留纪之交黔中古陆北缘，广泛发育代表晚奥陶世赫南特冰期后暖水沉积的石阡组，早前的研究多集中在石阡县城到城北约十公里坉坪（石阡组标准剖面所在地）。此次野外重点踏勘了更靠北（即坉坪与思南之间）的两系界线地层发育情况，找到近十条出露完好的界线地层剖面，积累了第一手野外数据，增进了对该区域在奥陶-志留纪之交古环境变迁情况的了解。\n\n　　桐梓的主要工作是详细采集红花园剖面湄潭组岩石样品；湄潭的工作重点是补充采集黄家坝高江剖面五里坡层化石标本。', NULL, '2019-12-15 04:44:41', 'admin', 1, 151, 2, 0, '87e86fa5-3969-41d5-be8c-024c82dac463.jpg');
INSERT INTO `biz_article` VALUES (154, 13, '人类演化', '编辑正文内容', NULL, '2019-12-15 05:44:28', 'admin', 1, 152, 2, 0, '9f584c53-7a47-4f1c-bb68-0753b65d4f06.jpg');
INSERT INTO `biz_article` VALUES (155, 13, '【新华社】古生物色彩有望复原 中国最古老鸟类化石羽毛中发现β角蛋白', '新华社南京１１月２２日电（记者王珏玢）记者从中科院南京地质古生物研究所获悉，由中美多位学者组成的科研团队在一项最新研究中，首次在中国最古老的鸟类、距今１．３亿年前的始孔子鸟化石羽毛中发现了β角蛋白。由于β角蛋白与识别鸟类羽毛中的色素体结构密切相关，这一新发现，也为复原原始鸟类和带毛恐龙等远古生物的真实色彩，提供了新的重要依据。\n\n　　相关研究成果已于２２日在线刊载于国际顶级科学期刊《美国科学院院报》。\n\n　　鸟类羽毛具有五彩缤纷的颜色，主要原因之一在于鸟羽中具有一类显示颜色的细胞结构：色素体。早在上世纪八九十年代，古生物学家就已经在鸟类化石羽毛中发现了类似色素体的结构，但当时人们认为，这些结构是化石形成中混入的“细菌”。２１世纪以来，美、中等多位古生物学家提出，这些早年判定的“细菌”，很可能就是远古鸟类的色素体。近年来，学术界开展了大量远古鸟类、带羽毛恐龙等不同生物化石色素体的研究。这些研究，为恢复灭绝生物羽毛等器官的颜色，开辟了一个新领域。', NULL, '2019-12-15 05:47:37', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (156, 13, '李保华等参加第12届国际古海洋学大会', '应英国伦敦自然博物馆Stephen Stukins博士、南安普敦大学海洋学院宣闯博士与荷兰乌得勒支大学地球科学系主任助理Marjolein  Mullen-Pouw邀请，中国科学院南京地质古生物研究所李保华研究员和郭启梅研究实习员于8月7日-9月4日赴英国伦敦、南安普敦进行访问，开展合作研究并参加在荷兰乌得勒支举办的第12届国际古海洋学大会。 ', NULL, '2019-12-15 05:48:25', 'admin', 1, 153, 2, 0, '72e383e8-a15c-49c1-b544-b4ee7cf6e038.jpg');
INSERT INTO `biz_article` VALUES (157, 14, '冯伟民荣获南京市“十大科技之星”', '12月26日下午，南京市第十一届“十大科技之星”颁奖典礼在南京市科技馆隆重举行。南京市委副书记龙翔同志等领导为获奖人员颁奖。南京古生物所冯伟民研究员当选“十大科技之星”。 \n\n    南京市“十大科技之星”旨在表彰具有“献身、创新、求实、协作”的科学精神和“坚持真理、诚实劳动、亲贤爱才、密切合作”的职业道德，在近五年取得突出成就的科技工作者。冯伟民因其在古生物学科普方面的杰出工作入选。包括南京途牛科技有限公司CEO于敦德、国电南瑞科技股份有限公司首席专家方勇杰等同批入选。', NULL, '2019-12-15 05:49:21', 'admin', 1, 155, 2, 0, 'f0a7f872-5542-4fbc-94c3-f10b0deb5c42.jpg');
INSERT INTO `biz_article` VALUES (158, 14, '现代古生物学新技术研讨会在南京举办', '日前，英国布里斯托大学Philip Donoghue教授等一行应邀访问南京，并于11月16日至18日在南京古生物所举办了一次面向全国古生物学领域青年学者和研究生免费开放的“现代古生物学新技术研讨会”。来自全国20所大学和科研院所共计100余人参加了本次研讨会。\n\n　　本次研讨会旨在拓展青年科学家的技术能力，帮助广大研究生扩展研究视野，开设的主题包括同步辐射三维无损成像技术及其古生物学应用、显微CT技术及其在古生物学领域中的应用、有限元分析技术和流体动力学分析技术及其在古生物学领域中的应用。各个主题的内容均由理论讲座和实操模拟培训组成。外方主讲人员包括来自英国布里斯托大学的Philip Donoghue教授、Emliy Rafield 教授、John Cunningham博士、Kelly Vargas博士、牛津大学Imran Raham博士和剑桥大学Alex Liu博士等。此外还邀请到了两位国内主讲人：卡尔蔡司x射线显微镜部北京demo实验室负责人、资深显微CT应用工程师曹春杰和奥威斯科技负责人、VGstudio软件资深应用工程师赵亮。', NULL, '2019-12-15 05:50:22', 'admin', 1, 156, 2, 0, '2b5729e5-f1e0-4287-988b-eaf91004197a.jpg');
INSERT INTO `biz_article` VALUES (159, 14, '南京古生物所召开“学宗旨，创新科技为民”中心组学习会', '根据中国科学院党组、江苏省委的部署，按照研究所“两学一做”学习教育的具体方案，11月28日下午，南京古生物所召开“两学一做”学习教育专题四“学宗旨，创新科技为民”中心组学习会，所党委委员、纪委委员、中层以上领导、党支部书记等20余人参加了会议。会议由南京古生物所党委书记王海峰主持。 \n\n　　王海峰首先带领大家进一步深入学习了党的十八届六中全会精神，传达了中科院院长白春礼在中科院学习宣传贯彻党的十八届六中全会精神工作部署会上的讲话精神。会议对南京古生物所学习宣传贯彻六中全会精神进行了部署，强调要把学习贯彻党的十八届六中全会精神作为当前和今后一个时期的重要政治任务，作为“两学一做”学习教育的头等大事，采取积极有力措施，迅速开展学习。 \n\n　　会上，大家还集中学习了习近平在纪念长征胜利80周年大会上的重要讲话精神，并对《中国共产党的九十年》以及《胡锦涛文选》的学习进行了部署。 ', NULL, '2019-12-15 05:51:15', 'admin', 1, 158, 2, 0, 'd4a37ff1-5eba-41f0-8e72-1e8a90066f60.jpg');
INSERT INTO `biz_article` VALUES (160, 16, '南京大学生物演化与环境科教融合中心正式成立', '2月19日，“南京大学生物演化与环境科教融合中心”成立暨揭牌仪式在南京大学地球科学学院举行。该中心是由中国科学院南京地质古生物研究所、中国科学院古脊椎动物与古人类研究所和南京大学共同创建的、跨系统的所校合作机构，也是国内首家将科学研究与人才培养紧密结合的实体机构。南京古生物所杨群所长、古脊椎动物所周忠和所长和南京大学陈骏校长共同为中心揭牌。 \n\n　　南京大学生物演化与环境科教融合中心旨在探索地史时期生命演化与环境变化的关系等重大科学问题，以及我国地球科学特别是地层古生物学科人才培养的新模式，以高水平的科研带动人才培养、科研与教育并进，在一个高起点的国际化平台上探索培养本科生和研究生的新体制和机制，打造国际化的地球科学专业人才培养基地和高水平、开放型科学研究基地。来自中科院两所的12位科学家受聘成为中心的责任教授，将参与中心未来的人才培养规划、课程建设与科研活动。中心主任为南京古生物所沈树忠院士，中心学术委员会主任为南京古生物所戎嘉余院士。 \n　　\n', NULL, '2019-12-15 05:52:32', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (161, 16, '南京古生物所接收地大山科大本科生来所交流', '1月17-18日，来自中国地质大学（武汉）和山东科技大学的共22名本科生到南京古生物所进行了为期两天的寒假交流活动。 \n\n　　南京古生物所副所长詹仁斌对同学们的到来表示了热烈的欢迎，并向同学们简要介绍了研究所的基本情况。南京古生物所张元动研究员、赵方臣副研究员、黄冰研究员和史恭乐副研究员分别做了题为《见证地球历史-化石、金钉子与地质事件》、《澄江动物群与寒武纪大爆发》、《漫谈史前第一次生物大灭绝事件-以腕足动物为例》、《植物化石告诉我们什么-以南极始新世化石为例》的学术报告。组织人事处就南京古生物所研究生的招生情况、培养模式和研究生待遇等方面进行了介绍，并回答了同学们就关心问题的咨询。 \n\n　　期间，同学们参观了南京古生物博物馆、标本馆、在研标本馆、公共技术服务中心和GBDB数据库等，对研究所的科研环境和实验设备等有了初步直观的认识。同学们还深入到研究所科研团队，了解科研一线情况。各研究团队导师就课题组的研究方向进行了介绍，并鼓励同学们在本科阶段好好学习，为将来进行科学研究打下坚实基础。 ', NULL, '2019-12-15 05:53:46', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (162, 16, '戎嘉余院士在浙江大学讲学', '2017年3月6日下午，中国科学院南京地质古生物研究所戎嘉余院士受浙江大学地球科学学院邀请在浙江大学玉泉校区教六203报告厅做“科学与中国”院士专家巡讲团专场报告，报告题目为“生物演化和我们”。报告会由浙江大学地球科学学院院长陈汉林教授主持，中国科学院院士、浙江大学地球科学学院杨树锋教授在内的60余位地球科学学院师生及公众听众参会，报告会另设浙江大学舟山校区海洋学院视频分会场。  \n　　', NULL, '2019-12-15 05:55:01', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (163, 17, '日本名古屋大学Tatsuo Oji教授访问南京古生物所', '2月23日至24日，日本古生物学会前理事长、日本名古屋大学Tatsuo Oji（大路树生）教授访问南京古生物所。南京古生物所所长杨群接待了Tatsuo Oji教授来访并就双方合作事宜进行了座谈交流。 \n\n　　访问期间，Tatsuo Oji教授为南京古生物所科研人员及研究生作了题为“Did \"Cambrian agronomic revolution\" started earlier in the Ediacaran? New evidence of intensive bioturbation from the latest Ediacaran of western Mongolia”的学术报告，就南京古生物所保存的埃迪卡拉纪化石标本与相关科研人员进行了交流，并参观了南京古生物博物馆。 ', NULL, '2019-12-15 05:57:19', 'admin', 1, 161, 2, 0, 'd17e3b12-43b0-4a35-90a9-18094533f425.jpg');
INSERT INTO `biz_article` VALUES (164, 17, '南京古生物所荣获2016年江苏省科学技术奖一等奖', '2月24日上午，2016年度江苏省科学技术奖励大会在南京隆重召开，江苏省委书记、省人大常委会主任李强，省委副书记、省长石泰峰等领导出席大会并向获奖代表颁奖。由中国科学院南京地质古生物研究所陈均远研究员等人完成的项目《距今6亿年前磷酸盐化动物和胚胎化石的发现与研究》荣获2016年度江苏省科学技术奖一等奖。 \n\n　　距今5.3亿年前动物在地球上的快速出现（“寒武纪大爆发”）被认为是生物演化历史上的三大谜题之一。发现于我国云南的寒武纪早期澄江动物群的发现和研究证实了寒武纪大爆发的真实性和突发性，陈均远等的相关研究成果曾获得2003年度国家自然科学奖一等奖。 ', NULL, '2019-12-15 05:58:58', 'admin', 1, 162, 2, 0, 'eefc7e73-3665-4690-ba84-ebb7343372de.jpg');
INSERT INTO `biz_article` VALUES (165, 17, '三位外籍专家获聘中科院国际访问学者', '在中国科学院国际人才交流计划的资助下，澳大利亚麦考瑞大学Glenn A. Brock教授、德国埃尔朗根大学Oliver Lehnert教授、俄罗斯地质研究所Anisimova S. Anatolievna博士分别于近日来到中国科学院南京地质古生物研究所开展合作研究。5月9日上午，南京古生物所杨群所长与三位外籍专家进行了座谈交流，对他们的到来表示热烈欢迎，介绍了研究所的基本情况，并向其颁发了中国科学院国际访问学者证书。 三位外籍专家的所内合作者、管理部门相关人员参加座谈并就相关合作事宜进行了交流。 \n\n　　Glenn A. Brock教授此次来访主要是与南京古生物所李国祥研究员合作开展中-澳寒武纪早期多门类动物骨骼化石和寒武系下部地层的洲际对比研究。 ', NULL, '2019-12-15 05:59:56', 'admin', 1, 163, 2, 0, '09a5d787-e603-4abc-8794-15df8790a6cb.png');
INSERT INTO `biz_article` VALUES (166, 18, '瓮安县副县长桂国全一行访问南京古生物所', '6月6日，贵州省瓮安县人民政府副县长桂国全一行7人访问中国科学院南京地质古生物研究所。南京古生物所杨群所长向桂国全一行的来访表示热烈欢迎，并向瓮安县政府对瓮安生物群研究和保护的重视和支持表示感谢。随后，桂国全一行与我所部分科学家代表就瓮安生物群化石产地的保护和合理开发利用、服务经济社会等内容进行了座谈，座谈会由南京古生物所副所长王向东主持。 \n\n　　座谈会上，桂国全一行首先介绍了瓮安生物群化石保护工作的最新进展，并就申请国家级重点保护古生物化石集中产地、规划建设野外科研及管理工作站、开展瓮安生物群科研项目申请和相关博物馆规划等，征求研究所专家意见建议。南京古生物所参会专家针对上述问题纷纷出谋划策，建议将相关工作与贵州省的旅游开发战略和瓮安县的经济社会和文化发展进一步深度结合，并表示，在产地保护和合理开发过程中只要能够帮助的，将全力支持地方政府相关工作的开展和落实', NULL, '2019-12-15 06:02:25', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (167, 18, '显生宙早期生物群宏演化专题讲座成功举办', '2017年5月16日至17日，“显生宙早期生物群宏演化及IGCP653项目前沿科学问题与途径”专题讲座在中国科学院南京地质古生物研究所成功举行并圆满结束。共有来自南京大学、西北大学、中南大学、中国地质科学院地质所、德国埃朗根大学、加拿大布兰登大学、澳大利亚麦考瑞大学以及南京古生物所等单位的60余位研究生和专家学者参加了该专题讲座。 \n\n　　该专题讲座由IGCP653项目（奥陶纪生物大辐射的启动过程，2016-2020，南京古生物所张元动研究员为共同主席）发起倡议，专门邀请了英国杜伦大学David Harper教授、法国里尔大学Thomas Servais教授及南京古生物所樊隽轩研究员，讲解显生宙早期的地层古生物学前沿科学问题、解决途径、新技术方法等，旨在促进和加深我国地层古生物研究的青年学者和研究生对显生宙早期生物群演化的认识，特别是关于寒武纪演化动物群向古生代演化动物群的宏演化过程及相关的古海洋、古地理和古气候变化等前沿科学主题的认识。 ', NULL, '2019-12-15 06:03:14', 'admin', 1, 164, 2, 0, '2a5c17bc-dc6a-4e5b-ada6-a24aaf23c46f.jpg');
INSERT INTO `biz_article` VALUES (168, 18, '南京古生物所与瑞典自然历史博物馆签订合作备忘录', '5月16日，瑞典自然历史博物馆（Swedish Museum of Natural History）古生物部主任Vivi Vajda教授一行二人应邀访问中国科学院南京地质古生物研究所，与研究所领导、相关部门负责人及科学家代表就双方合作事宜进行了座谈交流。南京古生物所杨群所长主持座谈会，詹仁斌副所长与Vivi Vajda教授分别代表双方共同签署了合作备忘录。 \n\n　　中国和瑞典在古生物学领域有着长期的合作历史，最早可追溯到20世纪20年代初。曾任南京古生物所第二任所长的斯行健院士（学部委员）曾在瑞典自然历史博物馆师从著名古植物学家T.G. Halle，研究该馆馆藏的中国植物化石标本。近年来，双方在科学家合作交流、研究生联合培养等方面，合作成果显著。双方一致同意在签署本次合作备忘录的基础上，进一步加强研究人员互访，联合野外考察和人才培养，共同推动在古植物和古无脊椎动物学等领域开展新的持续的科学合作。 ', NULL, '2019-12-15 06:04:07', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (169, 19, '王成源荣获国际牙形刺研究协会终身成就奖勋章', '近日，在第四届国际牙形刺大会在西班牙瓦伦西亚市召开期间，国际牙形刺研究协会（潘德尔学会）向中国科学院南京地质古生物研究所王成源研究员颁发了终身成就奖勋章，肯定和嘉奖他在长期不懈的牙形刺研究中所取得的丰硕成果，以及对国际牙形刺研究做出的重要贡献。 \n\n　　牙形刺形体微小，演化迅速，见于寒武纪至三叠纪的海相地层中，在地球历史上延续了大约3.4亿年，是进行地层划分与对比的重要的化石门类之一。牙形刺学科在我国建立以来，发展十分迅速，取得了很多重要的进展和成果。王成源长期从事牙形刺研究，是我国志留纪、泥盆纪、石炭纪和三叠纪牙形刺研究的开拓者，经过40多年的努力，解决了很多中国的和国外的（蒙古国，尔巴尼亚，越南等）重要的地层时代问题，已发表学术论文350多篇，其中退休以后发表100余篇论文以及多部研究专著，在国内外有重要的影响。今年是国际牙形刺研究协会成立50周年，王成源也是首次荣获该协会终身成就奖勋章的中国学者。', NULL, '2019-12-15 06:04:58', 'admin', 1, 165, 2, 0, '6ad1c858-8cdf-4485-b911-480383e7b981.jpg');
INSERT INTO `biz_article` VALUES (170, 19, '陈旭院士在中南大学讲学', '6月22日下午，中国科学院南京地质古生物研究所陈旭院士应邀出席中南大学名师名家学术论坛和中南大学地信院第十二届大地之子研究生学术论坛，在该校本部科教楼作了主题为“华南奥陶－志留纪之交的黑色页岩”的学术报告。地球科学与信息物理学院师生代表一起聆听了本次报告会。\n\n　　陈旭院士的报告立足古生物学研究的基础领域，聚焦我国华南页岩气勘探开发的热点层段，对华南奥陶-志留纪之交五峰组和龙马溪组两套黑色页岩发育的构造背景、时空分布和全球对比等问题做了精彩阐述。报告从地质学家丁文江先生于1929年提出广西运动说起，继而介绍了五峰组及龙马溪黑色页岩时空分布，分析了奥陶－志留纪两套黑色页岩与生物事件，并对奥陶－志留纪之交两套黑色页岩的全球对比，总结了奥陶－志留纪之交两套黑色页岩的两种分布模式，并简单介绍了大数据时代下黑色页岩时空分布的数值化研究的关键技术。陈旭院士及其资源地层学与古地理学团队，创造性地将将传统生物地层学研究的理论运用到非常规油气资源的勘探开发研究中，对华南早古生代页岩气的勘探与开发起了重要的指导作用。 ', NULL, '2019-12-15 06:05:40', 'admin', 1, 166, 2, 0, 'c2b1a1b1-f164-4294-8d44-addd04eb5507.jpg');
INSERT INTO `biz_article` VALUES (171, 19, '杨群当选为九三学社江苏省第八届委员会委员', '近日，九三学社江苏省第八次代表大会在南京隆重召开，会议选举产生了九三学社江苏省第八届委员会，南京古生物所所长杨群当选为九三学社江苏省第八届委员会委员。 ', NULL, '2019-12-15 06:06:22', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (172, 21, '中科院前沿局领导调研南京古生物所', '6月14日，中国科学院前沿科学与教育局局长高鸿钧、副局长张永清一行到中国科学院南京地质古生物研究所调研。南京古生物所领导班子，在宁研究员以及职能部门负责人参加了座谈交流。 \n\n　　南京古生物所所长杨群向高鸿钧一行汇报了研究所的基本情况，围绕研究所“一三五”规划取得的重要创新成果，以及近期面向国民经济主战场取得的系列进展。 \n\n　　高鸿钧向与会人员介绍了中科院前沿局的部门设置和基本职能，中科院战略先导专项和拔尖人才计划等的基本情况。他指出，当前中国科技界正面临着非常好的发展机遇，为实现国家“两个一百年”目标，中国科学院承担着重要的历史使命，需要每个科学家共同努力。中科院两个古生物所在前沿科学相关领域研究水平高、国际影响大、历史传承好，具有良好的发展基础。他表示，院前沿局也将通过顶层设计和专项支持等方式，鼓励和协调相关科研人员积极开展学科交叉，做大学科、大平台、大团队，争取在关键地史时期生物与环境演变过程及其机制等领域取得更多原创性突破。 ', NULL, '2019-12-15 06:07:30', 'admin', 1, 167, 2, 0, '13a5b832-429e-4e1b-93b6-29573e7dce99.jpg');
INSERT INTO `biz_article` VALUES (173, 21, '加拿大布兰登大学李荣玉教授访问南京古生物所', '5月5日至6月5日，加拿大布兰登大学李荣玉教授应邀访问中国科学院南京地质古生物研究所。访问期间，李荣玉与早古生代创新研究群体詹仁斌研究员、黄冰研究员等展开学术讨论与合作，还对所内研究生等进行了相关专业的指导与交流。 \n \n\n    5月10日上午，李荣玉在南京古生物所图书馆三楼报告厅做了题为“Reconstruction of food chain/web & a case study from the Upper Cretaceous of Manitoba, Canada ”的学术报告。报告首先介绍了现代生态系统中的食物链与食物网，以及重建地史时期生物间营养结构所需的证据，其中某些特殊保存的化石以及化石表面的生物扰动痕迹对于地史时期食物链食物网的重建具有重要意义。报告以加拿大Manitoba地区晚白垩世地层中保存的多门类化石为例，详细解读了所发现的化石表面钻孔和咀嚼捕食的痕迹，进而推理出各门类生物间的捕食和被捕食关系，并重建出该地区晚白垩世包含七级消费者的复杂食物链和食物网。 ', NULL, '2019-12-15 06:08:00', 'admin', 1, 168, 2, 0, '4017297f-b105-4131-92d5-95d45ca1f3c5.jpg');
INSERT INTO `biz_article` VALUES (174, 21, '南京古生物所2017级研究生报到', '丹桂飘香，荷花满塘，又是一年迎新时。 \n\n　　9月4日，中国科学院南京地质古生物研究所2017级17名硕士生和12名博士生入所报到。目前，我所在读研究生总数为91名（含2名外籍博士生），创历史新高。 \n\n　　9月5日上午，南京古生物所在行政楼一楼会议室举行2017级新生见面会暨所史所情教育。穆西南研究员结合生动的实例，向同学们详细讲解了南京古生物所的发展历程，与同学们一起回顾了研究所60多年所经历的曲折和辉煌。面对研究所当前新的黄金发展期，他希望大家继承古生物学先辈的优良传统，薪火相传，热爱祖国，献身科学，艰苦奋斗，自强不息，务实创新，勇攀高峰，再创辉煌！  \n\n　　接下来的一周为新生的入所教育周，将开展图书馆入馆教育、总体安全教育、实验室安全教育、入所教育、博物馆讲解培训等一系列活动。  \n\n', NULL, '2019-12-15 06:09:19', 'admin', 1, 169, 2, 0, 'c3158687-a3f7-4097-8124-a1fc1cbd9eb4.jpg');
INSERT INTO `biz_article` VALUES (175, 22, '“恐龙蛋的魅力”特展开展仪式在古生物博物馆举办', '9月17日上午，筹备已久的“恐龙蛋的魅力”科普特展在南京古生物博物馆隆重举行。中国科学院南京地质古生物研究所所长杨群、党委书记王海峰和副所长詹仁斌，浙江自然博物馆副馆长金幸生等领导和嘉宾出席了开展仪式。近三百名南京市民参加了此次活动，博物馆报告厅座无虚席。 \n\n　　詹仁斌在开展仪式上致辞指出，这是南京古生物博物馆首次与兄弟馆联合推出科普特展，展出的所有恐龙蛋展品均来自浙江自然博物馆馆藏品，并祝愿两馆合作推出的恐龙蛋展览取得圆满成功！ \n\n　　为配合特展的推出，金幸生为大家奉献了达尔文大讲堂第六讲“恐龙蛋诞恐龙”的精彩科普报告。报告通过展示浙江自然博物馆馆藏的大量恐龙蛋化石，讲述了恐龙蛋的野外发现、室内修复、研究鉴定的科学过程和科学方式，从一块块恐龙蛋保存状态，展示了恐龙从下蛋、孵化到出壳及生长等一系列恐龙繁殖生长过程，并解读了恐龙蛋赋存在岩石里的许多有趣现象。报告打开了公众了解恐龙世界的一扇窗口，让大家对恐龙蛋有了耳目一新的认识。全场听众对报告产生强烈的共鸣，报告之后的互动环节十分踊跃。', NULL, '2019-12-15 06:10:36', 'admin', 1, 170, 2, 0, '7adca35a-f054-4631-bf18-50a05775a2fc.jpg');
INSERT INTO `biz_article` VALUES (176, 22, '南古所院重与浙江九队、二六二大队共建联合实验室', '9月8日，中国科学院资源地层学与古地理学重点实验室与浙江省第九地质大队、浙江省核工业二六二大队共建联合实验室战略合作协议签约仪式暨院士专家报告会，在浙江湖州举行。', NULL, '2019-12-15 06:11:29', 'admin', 1, 171, 2, 0, '541e2a2e-1e91-4615-a494-00bed8ba4c98.jpg');
INSERT INTO `biz_article` VALUES (177, 22, '江苏省委书记娄勤俭视察南京古生物所', '11月23日下午，江苏省委书记娄勤俭一行，在中国科学院南京分院院长杨桂山的陪同下，视察了中国科学院南京地质古生物研究所。 \n\n　　娄勤俭书记一行听取了南京古生物所所长杨群有关研究所基本情况的汇报，并视察了现代古生物学和地层学国家重点实验室，参观了研究所技术服务中心和模式标本馆。 \n\n　　视察过程中，娄勤俭书记对南京古生物所悠久的研究历史，先进的科研设施，以及在澄江生物群等领域取得的世界一流的科研成果表示印象深刻，对研究所在国民经济建设特别是油气资源勘探与开发过程中所做的特殊贡献表示肯定。他对南京古生物所开发建设的GBDB数据库在页岩气勘探中的应用特别关注，希望研究所进一步加强江苏地区能源资源的勘探开发工作，为江苏地方经济发展再做贡献。 ', NULL, '2019-12-15 06:12:02', 'admin', 1, 172, 2, 0, '2af371f4-058c-4ccd-a8cc-cdf4e4912370.jpg');
INSERT INTO `biz_article` VALUES (178, 23, '南京古生物所2016级研究生顺利通过中期考核', '12月26日，中国科学院南京地质古生物研究所2016级研究生中期考核在行政楼一楼会议室举行。经过南京古生物所学位委员会评审，参加考核的8位博士生、17位硕士生、2位直博生全部顺利通过考核。其中张青青和王贺两位博士生，以及姜慧、汪瑶、龚方怡、俞婷婷、徐海鹏、吴一笑和李玉玲七位硕士生/直博生获得优秀。 \n\n　　研究生中期考核是提高研究生培养质量、树立良好学风、促进研究生德智体全面发展的保证，是研究生培养过程的重要环节。中期考核的主要内容包括开题报告及毕业论文准备情况、课程成绩及学分情况、参加科研项目及学术会议情况、发表论著及获奖情况、参加集体活动及综合素质等。所学位委员会委员们认真听取了研究生们的汇报，对研究生们已取得的研究成果和下一步工作计划进行了重点点评，特别是对存在的问题提出了中肯的建议。  \n\n', NULL, '2019-12-15 06:13:48', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (179, 23, '《岁月菁华——化石档案与故事》正式出版', '近日，由中国科学院南京地质古生物研究所编、杨群主编的《岁月菁华——化石档案与故事》专著由浙江大学出版社正式出版。　　\n\n　　南京古生物所收藏了自中国古生物学诞生之日起，古生物学家近百年来在国内外采集的古生物化石。本书从南京古生物所标本馆（博物馆）收藏的近20万件化石标本中，选取部分精品化石进行了集中展示。其中绝大多数都是第一次被发现和研究的模式标本，也是南京古生物所科学家在探索生命历史历程中的重大成果巡礼。每件化石的背后，都有精彩的故事，它们不仅记录了几十亿年地球生命的恢弘演化史，也记录了中古古生物学充满艰辛曲折却又辉煌灿烂的百年发展史。\n\n    本书以精美化石图片为主，配以中英文说明，图文并茂，是第一本集中展示我国近百年来古生物学研究积累的古无脊椎动物和古植物模式标本精品的画册。\n\n　　专著相关信息：中国科学院南京地质古生物研究所编，杨群主编，2017，岁月菁华——化石档案与故事，浙江大学出版社，ISBN：978-7-308-17629-3', NULL, '2019-12-15 06:15:22', 'admin', 1, 173, 2, 0, '7f919d25-ad21-4ad3-ab72-59ad75267482.jpg');
INSERT INTO `biz_article` VALUES (180, 23, 'GBDB团队与英国地调局开展第一阶段数字化合作', '2017年11月至2018年1月，中国科学院南京地质古生物研究所樊隽轩研究员带领GBDB团队受邀访问英国地调局，开展了为期三个月的地层古生物资料的数字化合作工作。 \n\n　　英国地调局是世界上历史最悠久的国家地调局，在其上百年的历史中积累了海量的露头剖面和钻井资料，但这些资料一直未能数字化，而仅是以纸质报告的方式保存在英国地调局内部。作为一个公共组织，英国地调局希望推动这些重要资料的数字化和开放获取，从而吸引更多的用户使用其数据资源。经过全球调研与比较，2017年上半年，英国地调局正式邀请南京古生物所GBDB团队，承担其地层古生物资料数字化工作。 \n　　', NULL, '2019-12-15 06:16:50', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (181, 28, '分子古生物学技术培训班在南京古生物所举办', '日前，英国布里斯托大学Philip Donoghue教授等一行8人应中国科学院南京地质古生物研究所殷宗军副研究员邀请访问南京，并于2月3日至5日在南京古生物所举办了一场面向全国古生物学和演化生物学领域青年学者和研究生免费开放的“分子古生物学培训班”。来自全国18所大学和科研院所的共计50余人参加了本次培训班。 ', NULL, '2019-12-15 06:19:18', 'admin', 1, NULL, 2, 1, NULL);
INSERT INTO `biz_article` VALUES (182, 28, '《中国显生宙腕足动物属志》正式出版', '近日，由中国科学院南京地质古生物研究所戎嘉余院士主编，金玉玕院士（已故）、沈树忠院士和詹仁斌研究员副主编，来自十家单位的24位学者先后历时近三十年编撰完成的《中国显生宙腕足动物属志》（Phanerozoic Brachiopod Genera of China）由科学出版社正式出版。该书是现阶段对中国显生宙腕足动物的一次全面而系统的总结，是一本门类古生物研究的学术参考书，也是一本专业性很强的学术工具书。 ', NULL, '2019-12-15 06:20:08', 'admin', 1, 175, 2, 1, '9f000514-f071-4f30-9f65-a2f3b9843049.jpg');
INSERT INTO `biz_article` VALUES (183, 28, '《中国晚古生代孢粉化石》正式出版', '近日，由中国科学院南京地质古生物研究所欧阳舒研究员、卢礼昌研究员、朱怀诚研究员和刘锋副研究员为期近十年编撰的《中国晚古生代孢粉化石》专著由中国科学技术大学出版社正式出版。\n\n　　该书是对我国晚古生代（包括少量晚志留世）孢粉化石50年研究成果的首次系统总结。书中收集了1960—2008年以来公开发表的有关文献及孢粉属种（295属，2288种），先按地层时代进行分工编撰，再按《植物命名国际法规》有关条款和R. Potonié分类系统进行系统厘定，归纳整理和汇总统一。\n\n    该书分为五章，第一章是晚古生代化石孢子、花粉系统分类下的属种描述；第2—4章分别总结了我国泥盆纪、石炭纪和二叠纪孢粉组合的演替序列，包括泥盆系–石炭系、石炭系–二叠系以及二叠系–三叠系的孢粉地层学界线；第六章探讨若干理论上和生物地层上的问题，包括陆生维管束植物起源于早志留世的孢粉证据、我国石炭纪—二叠纪孢粉植物群分区、裸子植物花粉优势组合在我国石炭—二叠纪纪出现的时间和空间分布序列及其在植物学、地质学上的意义；华夏孢粉植物群的主要特征、组合序列及某些孢粉属的首现层位。 ', NULL, '2019-12-15 06:21:18', 'admin', 1, 176, 2, 1, '98a536e2-606a-4002-9610-5c72514ebef3.jpg');
INSERT INTO `biz_article` VALUES (184, 29, '南京古生物所召开第十次发展战略研讨会', '为进一步谋划新时期研究所的创新卓越发展规划，3月19日，中国科学院南京地质古生物研究所召开第十次发展战略研讨会。所发展战略研究小组成员、特邀和列席专家以及小组办公室成员等共计20余人出席。会议由所发展战略研究小组组长沈树忠院士主持。 \n\n　　研讨会上，南京古生物所所长杨群代表所班子首先就研究所卓越创新发展的进展和思考做主题报告。他从推动率先行动计划、建设卓越中心，开展体制机制探索、推动人才队伍建设，强化基础研究成果，应用基础研究与成果转化，科学传播，以及技术平台、科教融合和新园区建设等多个方面，介绍了研究所近年来所取得的若干重要举措和进展，并对下一步研究所的改革和创新发展提出建议。报告强调，2017年南京古生物所在科学院分类改革中，联合其它单位成立的生物演化与环境卓越创新中心，是研究所发展的重要机遇，研究所学科布局、组织研讨、配套项目申请以及其它各项工作正在有序推进中。沈树忠院士介绍了目前正在推进的中科院战略先导专项（B类）项目和重大国际合作项目等的组织申报及相关工作进展情况。 ', NULL, '2019-12-15 06:27:36', 'admin', 1, 177, 2, 0, 'f9e1aef6-84bb-438c-a225-62ac02fbf3c7.jpg');
INSERT INTO `biz_article` VALUES (185, 29, '王博入选第三批国家“万人计划”青年拔尖人才', '近日，中共中央组织部办公厅公布了第三批国家“万人计划”青年拔尖人才入选人员名单（组厅字〔2018〕6号），中国科学院南京地质古生物研究所王博研究员入选并获得支持经费。 　　  \n\n　　  国家高层次人才特殊支持计划（简称国家“万人计划”）是国家层面实施的重大人才工程，旨在重点遴选一批自然科学、工程技术和哲学社会科学领域的杰出人才、领军人才和青年拔尖人才，给予特殊支持。根据《国家高层次人才特殊支持计划管理办法》（组通字〔2017〕9号），此次“万人计划”青年拔尖人才遴选经申报推荐、形式审查、组织同行专家评审、专项办会同平台部门组织咨询顾问组对建议人选进行审核、公示，领导小组批准等环节，最终产生“万人计划”青年拔尖人才人选189名（其中自然科学类138人，哲学社会科学、文化艺术类51人）。', NULL, '2019-12-15 06:28:49', 'admin', 1, 178, 2, 0, '740ec020-a143-47b9-a643-067b17949717.jpg');
INSERT INTO `biz_article` VALUES (186, 29, '中古学会古无脊椎动物学分会2017年度学术年会在南京召开', '2017年12月8-10日，中国古生物学会古无脊椎动物学分会2017年度学术年会在中国科学院南京地质古生物研究所顺利召开。来自国内的科研机构、高等院校、博物馆、出版机构、科普教育和化石保护等29家单位的专家学者和青年学生等150余名代表参加了会议。中国科学院院士陈旭、沈树忠，西北大学教授张兴亮，中国古生物学会理事长杨群、江苏省古生物学会理事长王海峰、中国古生物学会古生态专业委员会主任王向东、中国古生物学会秘书长王永栋等特邀嘉宾出席了大会开幕式。 \n\n　　在12月9日上午的大会开幕式上，古无脊椎动物学分会理事长詹仁斌致开幕词，对本次会议的召开表示祝贺并向参加会议的嘉宾代表表示诚挚欢迎和衷心感谢。古无脊椎动物学分会成立于2016年12月18日，旨在促进古无脊椎动物学同行间的交流与合作，促进学科发展，进而为我国的地层古生物事业做出贡献。本次会议是分会成立以来第一次独立召开的全国性学术研讨会，由古无脊椎动物学分会主办，现代古生物学和地层学国家重点实验室协办，南京古生物所承办。 ', NULL, '2019-12-15 06:29:40', 'admin', 1, 179, 2, 0, '5fd1cf1f-c638-4b88-99dd-1ef5a08d40ae.jpg');
INSERT INTO `biz_article` VALUES (187, 30, '南京古生物所举办2018年元旦晚会', '天地风霜尽，乾坤气象和。历添新岁月，春满旧山河！ \n\n　　2017年12月29日晚，中国科学院南京地质古生物研究所2018年元旦晚会在图书馆三楼报告厅精彩上演。南京古生物所党委书记王海峰、部分研究生导师、青年职工以及研究生等80多人欢聚一堂，喜迎新年！ \n\n　　晚会节目形式丰富，亮点精彩纷呈，全场气氛活跃。爵士舞《我的新衣》拉开了晚会的序幕，歌曲《如果的事》讲述了闺蜜之间那些不得不说的小秘密，小品《西征记》则诉说了单身狗的欢喜日常，古风舞蹈《礼仪之邦》彰显中国传统文化之魅力，哑剧《富人与穷人》更是将屌丝与高富帅的吐槽进行到底，乐器独奏《爱尔兰画眉》，优美的节奏和旋律流淌着如诗如画的景色和动人的情愫，对唱《我要你》重温着电影驴得水的故事，歌曲串烧《经典动画一锅炖》则将童年的种种往事不断勾起，压轴群舞《Gashina》更是点燃全场，激情四射。最后晚会在合唱歌曲《相亲相爱》中圆满结束。 \n\n　　此次晚会很好地展示了南京古生物所大家庭的良好精神面貌及研究生的青春朝气与活力', NULL, '2019-12-15 06:30:17', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (188, 30, '编辑标题', '编辑正文内容', NULL, '2019-12-15 06:30:57', 'admin', 1, NULL, 1, 0, NULL);
INSERT INTO `biz_article` VALUES (189, 30, '袁训来为地大（武汉）李四光学院地球科学菁英班授课', '2月26日上午，在中国地质大学（武汉）李四光学院2017年地球科学导论课上，中国科学院南京地质古生物研究所袁训来研究员为菁英班大一新生做了“漫谈古生物学”主题讲座。 \n\n　　袁训来从南京古生物所的发展历程讲起，向同学们阐释了化石的定义、形成过程以如何及通过化石了解生物的进化。随后，袁训来结合自己的研究实例向同学们介绍了化石形态、生存环境的复原步骤，并通过分享研究团队三峡埃迪卡拉生物群化石发现，鼓励同学们积极投入到古生物的学习研究中来，打开探索地球科学奥秘的大门。\n\n　　南京古生物所作为李四光学院菁英班共建单位之一，积极推进菁英班导论课堂和前沿课程的开设工作，定期组织所内专家为菁英班授课，吸引学生参加科创计划、暑期夏令营、寒假来所交流等，推动科教融合，培养创新型人才。 ', NULL, '2019-12-15 06:33:00', 'admin', 1, 181, 2, 0, '36ab6f60-903b-4db9-ac06-f0daffa6da93.jpg');
INSERT INTO `biz_article` VALUES (190, 31, '南京古生物所召开离退休老同志代表学习党的十九大精神研讨会', '为认真贯彻落实中国科学院党组、南京分院分党组的部署要求，推动中国科学院南京地质古生物研究所广大离退休干部职工掀起学习宣传贯彻党的十九大精神热潮，11月28日下午，南京古生物所召开离退休老同志代表学习宣传贯彻党的十九大精神研讨会。南京古生物所党委书记、副所长王海峰主持会议。 \n\n　　会上，王海峰首先带领大家回顾了党的十九大召开情况，阐述了十九大召开的重大意义及对世界发展的影响，尤其是结合十八大以来，我国在科研领域取得的重大成就，强调作为一名科技工作者，我们应倍感自豪和责任重大。他向全体与会人员传达了中科院离退休干部学习宣传贯彻党的十九大精神研讨会和南京分院离退休干部学习十九大精神学习研讨会精神，并对研究所党委《关于学习宣传贯彻党的十九大精神工作方案》进行了通报。 ', NULL, '2019-12-15 06:33:52', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (191, 31, '《海洋沉积物间隙生物调查规范》国际标准编制启动', '12月8日，《海洋沉积物间隙生物调查规范》国际标准编制工作启动会在青岛举行。中国科学院南京地质古生物研究所李保华研究员作为国际标准专家组成员承担相关编制工作任务。 \n\n　　由中国科学院海洋研究所主持，同济大学，国家海洋局第一、第二、第三海洋研究所，中国地质调查局青岛海洋地质研究所，中国科学院南海海洋研究所，中国地质大学（北京），中国科学院南京地质古生物研究所，以及中国海洋大学等单位多位专家共同参与起草的《海洋沉积物间隙生物调查规范》国家标准由国家标准化技术委员会10月14日正式发布实施。该国家标准是80年代以来首次新制定并实施的有关海洋调查国家标准，对从近岸、浅海到深海不同沉积环境下海底沉积物样品，提供了详细的从采集到实验室分析技术规程，包括主要的微体古生物化石门类如有孔虫、介形虫、放射虫、硅藻、颗石藻、沉积孢粉以及其他沉积物间隙生物类型的调查技术规范。', NULL, '2019-12-15 06:34:29', 'admin', 1, 182, 2, 0, '14a8c824-e281-40d4-8018-206ca965e56c.jpg');
INSERT INTO `biz_article` VALUES (192, 31, '南京古生物所举办师生篮球友谊赛', '天气再冷也要比赛，爱篮球就要有激情！12月11日，中国科学院南京地质古生物研究所师生篮球友谊赛在南京铁路体育馆举行。 \n\n　　参赛队员场下虽然是师生关系，但在球场上却是你争我赶，不放过任何一次得分的机会。南京古生物所党委书记王海峰的一记3分球拉开了比赛的序幕，上半场比赛，教师队凭借灵活的跑位和良好的团队合作，将比分优势拉大到10分之多。下半场比赛双方你来我往，研究生队配合越来越默契，体力优势渐显，最终研究生队以58:54赢得了比赛。 \n\n　　赛场上队员们积极投入、全力以赴，他们闪电般的速度，精准的抢断，尖锐的突破，巧妙的配合，花式的动作一次又一次地引爆现场，全场的喝彩声一波接着一波。场下的啦啦队员们热情高涨，不时为场上队员呐喊助威。 \n\n　　此次篮球赛不仅丰富了职工和研究生的业余文体生活，增加职工和研究生之间的相互了解，增强了团队精神和集体凝聚力，更燃起了大家投身体育运动的热情。', NULL, '2019-12-15 06:35:02', 'admin', 1, 183, 2, 0, 'f09452e3-d82f-461f-82c7-c420b3223df4.jpg');
INSERT INTO `biz_article` VALUES (193, 33, '云南大学东京大学师生到澄江站进行野外实习', '2月27日，云南大学地球系统科学研究中心与东京大学地球与行星科学系师生到中国科学院南京地质古生物研究所澄江古生物研究站进行野外教学实习，澄江站工作人员陪同参观了澄江化石群首发点及研究站的澄江动物群展览馆，为两校师生详细介绍了特异埋葬化石群及寒武纪生物大爆发等科学问题，并带队参观了澄江小滥田下寒武统地层剖面。 \n\n　　本次野外教学实习是云南大学-东京大学“地球系统科学联合培养项目”启动仪式的一部分，该项目由云南大学地球系统科学研究中心郑洪波教授、冯卓教授，东京大学Ryuji Tada教授、Akihiro Kano教授领导。参加实习的师生高度评价了南京古生物所在寒武纪大爆发研究领域所做出的杰出贡献。 \n\n', NULL, '2019-12-15 06:36:10', 'admin', 1, 184, 2, 0, '964dec7a-3385-49bb-88c0-41a133370196.jpg');
INSERT INTO `biz_article` VALUES (194, 33, '陈旭沈树忠院士专家工作站入选浙江省级工作站', '近日，由中国科学院南京地质古生物研究所陈旭院士、沈树忠院士与核工业井巷建设公司（浙江省第九地质大队、浙江省核工业二六二大队）共建的院士专家工作站经过浙江省科协组织的评审，入选为浙江省级院士专家工作站。\n\n　　院士专家工作站是我国实施产学研合作培养创新人才政策，推进产学研联合，在实践中集聚、培养高层次人才和创新人才，建设宏大的创新型科技人才队伍的重要举措，是服务经济社会发展，服务企业技术创新的开创性工作。\n\n　　一年以来，陈旭院士、沈树忠院士为地质队的工作开展、创新人才培养、履行社会责任等出谋划策、牵线搭桥。两位院士多次携中石油系统、北京大学、南京大学等知名专家，通过院士专家工作站，与湖州长兴以及德清三地的科协和国土资源系统，开展学术交流，实地指导地质队地学科研、地质找矿和科技创新工作。此外，两位院士多次在当地进行科普讲座，为公众普及地球科学知识。', NULL, '2019-12-15 06:36:43', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (195, 33, '南京古生物所召开迎新春统战工作座谈会', '2月6日下午，中国科学院南京地质古生物研究所党委在行政楼一楼会议室召开统一战线迎新春座谈会，各民主党派代表及归侨侨眷代表等20余人参加。南京古生物所所长杨群、党委书记王海峰、副所长王向东和詹仁斌出席座谈会。王向东主持会议。 \n\n　　座谈会上，王向东代表南京古生物所领导班子、所党委向广大统战人士致以新春的问候，衷心感谢大家对研究所中心工作的支持和付出。王海峰向大家传达了党的十九大主要精神，介绍了研究所组织学习十九大报告的基本情况。 \n\n　　与会代表围绕2017年度南京古生物所工作报告展开热烈讨论。大家对研究所过去一年取得的成绩倍感振奋，一致认为2017年研究所各项事业得到了进一步提升，发展态势喜人。同时，与会者也围绕研究所的总体发展，对学科建设、人才培养、科学普及、园区建设、技术支撑、精准扶贫等方面的工作提出了意见和建议。九三学社老领导穆西南在发言中指出，党的十九大的召开非常重要，得到了全国人民的一致拥护，中共一直在凝聚人心不忘初心，为中国人民谋福祉，我们民主党派坚决拥护中国共产党的领导，民主党派也要为国家发展贡献自己的力量；研究所的成果很多，以后更要凝聚力量，增强文化自信，实现自我价值', NULL, '2019-12-15 06:37:14', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (196, 34, '南京古生物所召开新任支部书记、支委培训会', '为进一步强化支部工作能力，切实提升基层党支部的组织力，7月5日上午，中国科学院南京地质古生物研究所召开新任支部书记、支委培训会。在宁的支部书记、支委共24人参加了会议，所领导班子成员、所党委委员到会指导。 \n\n　　南京古生物所所长詹仁斌首先向新任的支部书记、支委们表示了祝贺。他指出，支部书记、支委是一种荣誉更是一种责任，希望大家在新的岗位上，把自己做好，把支部带好，不断强化四个自信，提升四个意识，坚决做到两个维护，充分发挥好党支部的战斗堡垒作用。 \n\n　', NULL, '2019-12-15 06:38:06', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (197, 34, '南京古生物所姜慧荣获中科院优秀共青团员', '近日，中国科学院南京地质古生物研究所姜慧荣获2018年度中国科学院优秀共青团员（全院98名），并参加了现场授奖仪式。 \n\n　　希望广大团员青年以先进为榜样，立足本职，奋发有为，在深入实施“率先行动”计划，建设世界科技强国的伟大征程中贡献自己的青春力量', NULL, '2019-12-15 06:39:22', 'admin', 1, 186, 2, 0, '39e46c3d-e0f0-4731-b975-6508fb1a11ea.jpg');
INSERT INTO `biz_article` VALUES (198, 34, '南京古生物所召开第十届工会会员代表大会', '2019年4月28日，中国科学院南京地质古生物研究所召开第十届工会会员代表大会。会员代表、特邀代表和列席代表60多人参加了大会，江苏省教育科技工会副主席陈望进、科研院所部部长崔文华应邀出席了大会。 \r\n\r\n　　按照大会议程首先召开了预备会，通过了代表资格审查报告和大会主席团名单，然后在庄严的国歌声中进入了大会正式议程。南京古生物所党委书记杨涛、省教科工会副主席陈望进在致辞中充分肯定了第九届工会委员会开展的各项工作和取得的成绩，并希望新一届职代会和工会委员会在建言献策民主办所、维护权益做好监督、培育劳模树立典型、组织活动凝心聚力、关爱职工送上温暖等方面更加深入广泛地开展工作，积极营造团结和谐、爱岗敬业、奋发进取、争创一流的良好氛围，为促进研究所创新发展作出新的贡献。 \r\n\r\n　　南京古生物所第九届工会暨第七届职代会常设主席团主席王军代表第九届工会委员会和第七届职代会作了题为《围绕中心、服务大局、凝心聚力，在构建和谐奋进的研究所中发挥积极作用》的工作总结报告。第九届工会经费审查委员会委员刘静代表工会经费审查委员会做了工会经费审查报告。 ', NULL, '2019-12-15 06:40:38', 'admin', 1, 187, 2, 0, '3eb4188a-ea52-4c95-8d3d-56c107344e75.jpg');
INSERT INTO `biz_article` VALUES (199, 35, '学术出版物', '  《古生物学报》、《地层学杂志》、《微体古生物学报》、Palaeoworld、Palaeoentomology和《生物进化》等期刊编辑部均设于本所。其中前三种期刊是中国古生物学和地层学领域最高级别的专业期刊；Palaeoworld是现代古生物学和地层学国家重点实验室主办并由Elsevier出版的国际学术刊物（1-14卷过刊全文下载）；Palaeoentomology是由国际古昆虫学会委托本所主办的由新西兰Magnolia Press出版的双月刊；《生物进化》是面向公众的古生物科普期刊。本所不定期连续出版物有《中国古生物志》（新甲种---中国的植物化石、新乙种-中国的无脊椎动物化石）、《Palaeontologica Cathayana》(英文版)、《中国科学院南京地质古生物研究所集刊》、《中国科学院南京地质古生物研究所丛刊》和《古植物学和孢粉学文集》等。', NULL, '2019-12-15 06:41:32', 'admin', 1, 188, 2, 0, '5bbe15f0-d983-49ca-91f1-9cd31382bcd9.jpg');
INSERT INTO `biz_article` VALUES (200, 35, '南京古生物所召开第八届一次职工代表大会', '2019年4月28日，中国科学院南京地质古生物研究所召开第八届职工代表大会第一次会议。出席会议的有南京古生物所第八届职代会正式代表、特邀代表和列席代表60余人。 \n\n　　南京古生物所所长詹仁斌代表所领导班子向大会做了班子任期目标报告。报告从九个方面对未来五年的工作进行了展望：战略规划与科技布局、承担科技任务与成果产出、队伍建设、科研平台与条件建设、科技合作与产业化、党建与创新文化建设、反腐倡廉工作、改革与管理创新、与研究所改革发展和管理相关的其他目标等。 \n\n　　职代会提案组向大会做了上届提案落实情况及本届大会提案征集情况报告。大会还安排专人向与会代表介绍了提交会议审议的三个规章制度的有关情况。 \n\n　　大会代表分成三个小组，围绕领导班子任期目标和三个规章制度等进行了审议，并对研究所各项工作提出了意见和建议，讨论热烈，充分体现了各位代表的主人翁精神和对研究所可持续发展的高度责任感。在主席团扩大会议上，三个讨论小组的召集人就相关意见和建议与职代会主席团、所领导及各职能部门负责人进行了深入交流。 ', NULL, '2019-12-15 06:43:29', 'admin', 1, 189, 2, 0, 'c3a904e5-9b87-45bf-bbfb-aa22612cfa77.jpg');
INSERT INTO `biz_article` VALUES (201, 35, '南京古生物所举办2019年迎春联欢会', '寒辞去冬雪，暖带入春风。共欢新故岁，迎送一宵中。 \n\n　　1月23日下午，在冬日的暖阳中，中国科学院南京地质古生物研究所2019年迎春联欢会在南京古生物博物馆二楼报告厅拉开帷幕。南京古生物所在职职工、离退休职工和研究生等近四百人欢聚一堂，喜迎新春！ \n\n　　', NULL, '2019-12-15 06:44:09', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (202, 36, '南京古生物所女职工在“好家风 好家训”评选活动获佳绩', '为认真学习贯彻落实党的十九大精神，响应江苏省教育科技工会年初开展的“培育好家风——女职工在行动”主题实践活动，引导广大女职工自觉践行社会主义核心价值观，发扬中华民族传统家庭美德，带头弘扬主旋律、树立新风尚，建设幸福家庭，以好的家风支撑起好的社会风气，中国科学院南京地质古生物研究所工会女职工委员会在全所女职工中开展了“好家风 好家训”征文征集评选活动，共收集到推荐作品6篇。经省教育科技工会评审，共获二等奖2名，三等奖1名，所工会女职工委员会获优秀组织奖。', NULL, '2019-12-15 06:47:22', 'admin', 1, 191, 2, 0, '3111c197-ad51-49f3-bdd0-5be1c00b695e.jpg');
INSERT INTO `biz_article` VALUES (203, 37, '寒武系乌溜阶“金钉子”被国际地科联批准建立', '国际地质科学联合会（国际地科联）最近以全票的表决结果，批准把寒武系第三统和第五阶的全球标准层型剖面和点位（“金钉子”）建立在中国贵州剑河。国际地科联秘书长、美国加州州立大学教授Stan Finney日前签发了国际地科联的批准书。这是我国所获得的第11个“金钉子”，结束了国际地层委员会寒武系分会对该“金钉子”的长达20余年的研究和选择。 \n\n　　该“金钉子”的研究由贵州大学赵元龙教授主持，联合中国科学院南京地质古生物研究所和美国俄亥俄州立大学等8个中外单位的专家所组成的国际团队研究完成。这也是南京古生物所主持研究或参与研究的第9个“金钉子”。 ', NULL, '2019-12-15 06:48:32', 'admin', 1, NULL, 2, 0, NULL);
INSERT INTO `biz_article` VALUES (204, 38, '南京古生物所与泰国玛哈沙拉堪大学签订合作备忘录', '2019年11月19日，在北京参加第一届亚洲古生物学大会暨中国古生物学会成立90周年纪念活动期间，泰国玛哈沙拉堪大学（Mahasarakham University）代表团一行7人应邀与中国科学院南京地质古生物研究所所长詹仁斌以及研究所科研和管理人员代表进行了座谈交流。期间，南京古生物所党委副书记、纪委书记蔡华伟与玛哈沙拉堪大学古生物研究和教育中心主任Mongkol Udchachon博士分别代表双方签署了合作备忘录。 ', NULL, '2019-12-15 06:49:49', 'admin', 1, NULL, 2, 1, NULL);
