INSERT INTO `biz_article` VALUES (210, 44, '最新版中国综合地层时间框架发布', '新华社南京1月21日电（记者王珏玢）记者从中科院南京地质古生物研究所获悉，最新版中国综合地层和时间框架近日发布，对全球或区域地层的深化研究、各省区市开展大比例尺地质填图工作以及在相对精准的时间尺度开展生物演化研究具有重要意义。\n\n \n　　在地质历史时期中，发生了生物大辐射、大灭绝等重大的生物事件，和大陆重组、全球海平面升降等环境剧变事件。为了了解这些事件发生的时间、顺序、速度和原因，需要把它们在统一的时间框架中排定。', NULL, '2019-12-15 06:53:28', 'admin', 1, 195, 2, 0, '8025abc9-351f-4704-bfdd-69f7d5199c34.jpg');
INSERT INTO `biz_article` VALUES (211, 45, '研究发现近4亿年前华南板块大部分被海水淹没', '新华社南京11月27日电（记者王珏玢）记者从中国科学院南京地质古生物研究所获悉，该所科研人员最新通过地层古生物学考察发现，在距今4.1亿年至3.5亿年之间，海水曾自西向东漫延，淹没了现今华南板块的绝大部分陆地。在当时，现在的江西、湖南等省份，全部处于海平面以下。\n\n　　古地理学研究显示，现今的中国在4亿多年前由8个板块构成，其中最大的一个是南起冲绳海槽、北至秦岭淮河的华南板块。这一板块范围包括现在的云南、贵州、四川、重庆、湖南、湖北、浙江、江西、福建、广东、广西、江苏南部等地以及越南北部地区和黄海、东海。', NULL, '2019-12-15 06:54:02', 'admin', 1, 196, 1, 0, '62c0b5dc-99a7-49a1-9d89-d53b0e0c9612.jpg');
INSERT INTO `biz_article` VALUES (212, 46, '四千万年前西藏中部曾有热带雨林', '本报南京10月25日电 （记者姚雪青）记者从中国科学院南京地质古生物研究所获悉：该所研究团队与英国、印度研究人员合作，对西藏产的琥珀化石进行系统研究，分析认为，4000万年前，西藏中部曾是一片湿润温暖的热带雨林。这为了解青藏高原的古环境提供了关键证据，研究成果在线发表于古生物学期刊《远古世界》。\n\n　　南京地质古生物研究所研究员王博介绍，研究团队对西藏伦坡拉盆地的琥珀进行了研究，研究表明西藏琥珀来源于龙脑香科植物，这是现今亚洲热带雨林的代表植物，其现今生活的最大海拔为1300米。通过对介形类和孢粉化石的生物地层学研究，并综合前人成果，表明西藏中部曾存在热带雨林，其海拔不会超过1300米，这与现在西藏琥珀产地所处的平均海拔4500米的环境截然不同。', NULL, '2019-12-15 06:54:38', 'admin', 1, NULL, 2, 0, NULL);
