INSERT INTO `biz_article` VALUES (215, 9, '把不忘初心牢记使命作为加强党的建设的永恒课题', '<p><br></p><p><strong style=\"color: rgb(51, 51, 51);\" class=\"ql-size-huge\">核心提示</strong></p><p class=\"ql-align-justify\">回顾党的历史，为什么我们党在那么弱小的情况下能够逐步发展壮大起来，在腥风血雨中能够一次次绝境重生，在攻坚克难中能够不断从胜利走向胜利，根本原因就在于不管是处于顺境还是逆境，我们党始终坚守为中国人民谋幸福、为中华民族谋复兴这个初心和使命。今天，我们比历史上任何时期都更接近、更有信心和能力实现中华民族伟大复兴。但千万不能在一片喝彩声、赞扬声中丧失革命精神和斗志，而要牢记船到中流浪更急、人到半山路更陡，切实把不忘初心、牢记使命作为加强党的建设的永恒课题，作为全体党员、干部的终身课题。</p><p class=\"ql-align-justify\">习近平总书记在中央政治局第十五次集体学习时强调，党的初心和使命是党的性质宗旨、理想信念、奋斗目标的集中体现，越是长期执政，越不能忘记党的初心使命。他还强调，把不忘初心、牢记使命作为加强党的建设的永恒课题，作为全体党员、干部的终身课题。习近平总书记的重要讲话，深刻回答了我们党“如何永葆先进性和纯洁性、永葆青春活力，如何永远得到人民拥护和支持，如何实现长期执政”这一根本性问题，对在新时代把党的自我革命推向深入，把党建设成为始终走在时代前列、人民衷心拥护、勇于自我革命、经得起各种风浪考验、朝气蓬勃的马克思主义执政党，具有重大理论意义和实践意义。</p><p class=\"ql-align-justify\"><strong>中国共产党的历史，就是一部不忘初心、牢记使命的奋斗史</strong></p><p class=\"ql-align-justify\">把不忘初心、牢记使命作为加强党的建设的永恒课题，有着深厚的历史逻辑。鸦片战争后，为争取国家独立、人民解放，实现中华民族的伟大复兴，各种政治力量、无数仁人志士进行了不屈不挠的探索斗争，但终究未能改变旧中国的社会性质和中国人民的悲惨命运。正是在近代中国社会的剧烈运动中，在中国人民反抗封建统治和外来侵略的激烈斗争中，在马克思列宁主义同中国工人运动的结合过程中，一九二一年中国共产党应运而生。中国共产党一经成立，就把实现共产主义作为党的最高理想和最终目标，义无反顾肩负起实现中华民族伟大复兴的历史使命，团结带领人民进行了艰苦卓绝的斗争，谱写了气吞山河的壮丽史诗。</p><p class=\"ql-align-justify\">为中国人民谋幸福、为中华民族谋复兴，是砥砺一代代中国共产党人前赴后继、不懈奋斗的根本动力。从革命时期李大钊、彭湃、张太雷、方志敏、左权、彭雪枫、马本斋、董存瑞、刘胡兰、江竹筠等共产党人“捐躯赴国难，视死忽如归”，到新中国成立后雷锋、王进喜、邓稼先、钱学森、焦裕禄、孔繁森、谷文昌、杨善洲、廖俊波等共产党人为国为民无私奉献，一代代中国共产党人用鲜血和生命诠释着中国共产党的初心使命。在党的奋斗历程中孕育形成的红船精神、井冈山精神、长征精神、延安精神、西柏坡精神、“两弹一星”精神、载人航天精神、塞罕坝精神等，构成了承载着中国共产党人初心使命的精神谱系，激励着一代代中国共产党人奋勇前行。</p><p class=\"ql-align-justify\">中国共产党成立以来的近百年历史，就是一部不忘初心、牢记使命的伟大奋斗史。为实现民族独立、人民解放，为实现国家富强、人民幸福，中国共产党人历经千难万险，初心不改，攻克了一个又一个看似不可攻克的难关，创造了一个又一个彪炳史册的人间奇迹。我们党不忘初心、牢记使命，经受住种种挫折和苦难的磨练，团结带领中国人民找到了一条农村包围城市、武装夺取政权的正确革命道路，建立了中华人民共和国，实现了中国从几千年封建专制政治向人民民主的伟大飞跃；我们党不忘初心、牢记使命，团结带领中国人民完成社会主义革命，确立社会主义基本制度，完成了中华民族有史以来最为广泛而深刻的社会变革，实现了中华民族由近代不断衰落到根本扭转命运、持续走向繁荣富强的伟大飞跃；我们党不忘初心、牢记使命，团结带领中国人民进行改革开放新的伟大革命，开辟了中国特色社会主义道路，使中华民族大踏步赶上时代，迎来了从站起来、富起来到强起来的伟大飞跃。</p><p class=\"ql-align-justify\">正如习近平总书记所指出的，回顾党的历史，为什么我们党在那么弱小的情况下能够逐步发展壮大起来，在腥风血雨中能够一次次绝境重生，在攻坚克难中能够不断从胜利走向胜利，根本原因就在于不管是处于顺境还是逆境，我们党始终坚守为中国人民谋幸福、为中华民族谋复兴这个初心和使命，义无反顾向着这个目标前进，从而赢得了人民衷心拥护和坚定支持。</p><p class=\"ql-align-justify\"><strong>越是长期执政，越不能忘记党的初心使命</strong></p><p class=\"ql-align-justify\">今年是中华人民共和国成立70周年，也是我们党在全国执政第70个年头。习近平总书记指出，我们党作为百年大党，如何永葆先进性和纯洁性、永葆青春活力，如何永远得到人民拥护和支持，如何实现长期执政，是我们必须回答好、解决好的一个根本性问题。</p><p class=\"ql-align-justify\">不忘初心、牢记使命，是永葆共产党人政治本色的需要。党的初心和使命集中体现着党的性质宗旨、理想信念、奋斗目标，集中体现着中国共产党人的政治本色。中国共产党是中国工人阶级的先锋队，同时是中国人民和中华民族的先锋队。我们党之所以能够带领全国人民取得革命、建设、改革的胜利，始终赢得人民群众的拥护和支持，就在于我们党是一个用马克思主义武装起来的党，是一个立志为中国人民谋幸福、为中华民族谋复兴的党，是一个为了人民和民族的利益而敢于斗争、敢于牺牲的党，是一个具有先进性和纯洁性的党。进入新时代，我们党要团结带领人民实现“两个一百年”奋斗目标，实现中华民族伟大复兴，必须永葆先进性和纯洁性，永葆共产党人政治本色。这就要求我们始终铭记党的性质和宗旨，铭记党的初心和使命。</p><p class=\"ql-align-justify\">不忘初心、牢记使命，是推动党和人民事业不断取得新胜利的需要。经过近百年艰苦奋斗，我们党团结带领人民取得巨大历史性成就，迎来了实现中华民族伟大复兴的光明前景。越是成就巨大，越是接近目标，越是要不忘初心、牢记使命。习近平总书记深刻指出，功成名就时做到居安思危、保持创业初期那种励精图治的精神状态不容易，执掌政权后做到节俭内敛、敬终如始不容易，承平时期严以治吏、防腐戒奢不容易，重大变革关头顺乎潮流、顺应民心不容易。这警示全党，决不能因为胜利而骄傲，决不能因为成就而懈怠，决不能因为困难而退缩。要在新时代的新征程上不断取得新的胜利，必须坚守党的初心和使命。</p><p class=\"ql-align-justify\">不忘初心、牢记使命，是应对各种风险挑战的需要。在长期执政条件下，各种弱化党的先进性、损害党的纯洁性的因素无时不有，“四大考验”“四种危险”依然复杂严峻，如果不严加防范、及时整治，久而久之，必将积重难返，小问题就会变成大问题、小管涌就会沦为大塌方。对此，我们要保持高度警惕，始终坚守初心使命，发扬自我革命精神，以刮骨疗伤的勇气和魄力，坚决同一切弱化党的先进性、损害党的纯洁性的问题作斗争，把党建设得更加坚强有力。</p><p><br></p><p><img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-align-justify\"><strong>事业发展永无止境，共产党人的初心永远不能改变</strong></p><p class=\"ql-align-justify\">不忘初心、牢记使命贵在慎终如始、持之以恒。党的十八大以来，我们党坚持全面从严治党，刹住了一些过去被认为不容易刹住的歪风邪气，克服了一些司空见惯的顽瘴痼疾，党风政风明显好转。但要看到，党的自我革命任重道远，决不能有松口气、歇歇脚的想法，不能有一劳永逸的想法，不能有见好就收的想法。只有始终不渝以自我革命精神扎实推进全面从严治党，才能把党建设成为始终走在时代前列、人民衷心拥护、勇于自我革命、经得起各种风浪考验、朝气蓬勃的马克思主义执政党，确保党始终成为中国特色社会主义事业的坚强领导核心。</p><p class=\"ql-align-justify\">建设伟大工程与推进伟大事业是密切联系在一起的。中国特色社会主义是改革开放以来党的全部理论和实践的主题，是党和人民历尽千辛万苦、付出巨大代价取得的根本成就。一以贯之推进中国特色社会主义伟大事业，必须一以贯之推进党的建设新的伟大工程。中国特色社会主义进入新时代，党要团结带领人民夺取新时代中国特色社会主义伟大胜利，必须保持战略定力和政治定力，始终不忘初心、牢记使命，不断增强党自我净化、自我完善、自我革新、自我提高能力，永葆旺盛生命力和强大战斗力。</p><p class=\"ql-align-justify\">1949年3月23日，党中央离开西柏坡前往北京时，毛泽东同志说：“今天是进京赶考的日子。”70年来，我们党在这场历史性考试中取得了优异成绩。今天，我们比历史上任何时期都更接近、更有信心和能力实现中华民族伟大复兴。但要清醒认识到，党面临的“赶考”还远未结束。面向未来，面对挑战，全党要始终坚守初心和使命，矢志不渝，英勇奋斗，继续以逢山开路、遇水架桥的开拓精神，强体魄于伟大的自我革命，开新局于伟大的社会革命，继续在历史性考试中接受检验，努力向历史、向人民交出新的更加优异的答卷。 （程瑞山）</p><p><br></p><p><br></p>', NULL, '2019-12-16 13:20:53', 'admin', 1, NULL, 2, 0, NULL);
