INSERT INTO `biz_article` VALUES (217, 4, '学习党的十八届六中全会精神', '<p>12月21日上午，公司组织中层以上干部集中学习党的十八届六中全会精神。会议由公司史书记主持。史书记在学习中说，十八届六中全会系统总结了近年来特别是党的十八大以来全面从严治党的理论和实践，就新形势下加强党的建设作出了新的重大部署，充分体现了党中央坚定不移推进全面从严治党的坚强决心和历史担当，体现了全党的共同心声，是指导当前和今后一个时期全面从严治党的行动指南。特别是十八届六中全会审议通过了《关于新形势下党内政治生活的若干准则》和《中国共产党党内监督条例》两个重要党内法规，正式提出“以习近平同志为核心的党中央”，这是党和国家根本利益所在，是坚持和加强党的领导的根本保证，要坚定不移维护党中央权威和党中央集中统一领导。12月21日上午，<img src=\"data:image/jpeg;base64,\"></p><p>公司组织中层以上干部集中学习党的十八届六中全会精神。会议由公司史书记主持。史书记在学习中说，十八届六中全会系统总结了近年来特别是党的十八大以来全面从严治党的理论和实践，就新形势下加强党的建设作出了新的重大部署，充分体现了党中央坚定不移推进全面从严治党的坚强决心和历史担当，体现了全党的共同心声，是指导当前和今后一个时期全面从严治党的行动指南。特别是十八届六中全会审议通过了《关于新形势下党内政治生活的若干准则》和《中国共产党党内监督条例》两个重要党内法规，正式提出“以习近平同志为核心的党中央”，这是党和国家根本利益所在，是坚持和加强党的领导的根本保证，要坚定不移维护党中央权威和党中央集中统一领导。</p>', NULL, '2019-12-17 04:58:59', 'admin', 1, 200, 2, 0, '67c3a80e-4235-4c61-852d-0b0c98a8ae4e.jpg');
