INSERT INTO `biz_article` VALUES (221, 16, '不忘初心', '<p class=\"ql-indent-1\"><span style=\"color: rgb(102, 102, 102);\" class=\"ql-size-huge\">2019年6月28日，内蒙古矿业开发有限责任公司组织全体职工开展迎七一，庆党建“不忘初心，牢记使命”经典诵读主题活动。</span></p><p class=\"ql-indent-1\"><img src=\"data:image/jpeg;base64,\"></p><p class=\"ql-indent-1\"><span style=\"color: rgb(102, 102, 102);\">2019年6月28日，内蒙古矿业开发有限责任公司组织全体职工开展迎七一，庆党建“不忘初心，牢记使命”经典诵读主题活动。</span></p><p class=\"ql-indent-1\"><img src=\"data:image/jpeg;base64,\"></p><p>全场共6个代表队，18组选手参加比赛，诵读红色经典。比赛开始前，全体党员重温入党誓词。选手们慷慨激昂，掷地有声诵读了《毛主席经典诗词》《党旗颂》《长征精神》等著作。来自第一党支部的齐诵《天耀中华》将整场比赛推向高潮。</p><p>团委代表队的诵读作品《献身地质化蛹为蝶》荣获了本次大赛的最佳诵读奖。这次诵读活动不止在党员干部心中树立起了“不忘初心，牢记使命”的伟大志愿，更激发了全体职工努力拼搏，奋发向上的职业精神。</p><p class=\"ql-indent-1\"><br></p><p class=\"ql-indent-1\"><br></p>', NULL, '2019-12-20 13:09:46', 'admin', 1, NULL, 2, 0, NULL);
