INSERT INTO `biz_article` VALUES (225, 6, 'vue项目部署到nginx', '一.vue项目打包<strong>修改config/index.js的assetsPublicPath为 ./（注意一定是</strong>build<strong>里面的，下面</strong>dev<strong>中也有这个配置）</strong><img src=\"https://img-blog.csdnimg.cn/20190526172928885.png\" alt=\"![在这里插入图片描述](https://img-blog.csdnimg.cn/20190526172551783.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjU2NTEzNw==,size_16,color_FFFFFF,t_7\" />这个路径的配置很重要，默认是项目名称。如果没有修改路径会变成这样，访问不到打包后的文件。就算返回200，你会发现返回的根本不是那些打包后的文件。<img src=\"https://img-blog.csdnimg.cn/20190526173514687.png?x-oss-process=image/watermark,type_ZmFuZ3poZW5naGVpdGk,shadow_10,text_aHR0cHM6Ly9ibG9nLmNzZG4ubmV0L3dlaXhpbl80MjU2NTEzNw==,size_16,color_FFFFFF,t_70\" alt=\"在这里插入图片描述\" /><strong>打包成dist文件</strong>npm run build 这时我们就可以把生成的dist文件扔到服务器就可以了。我这里使用xshell进行远程连接，xftp进行文件传输。二.配置nginx<strong>安装nginx</strong>安装的步骤我这里不详细介绍，安装后通过<strong>nginx -v</strong>&amp;nbsp;可测试是否安装成功<strong>修改nginx的配置文件</strong>默认路径：vim /etc/nginx/nginx.conf 在 http{ } 中配置一个serverserver { &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; listen 8080;&amp;nbsp; &amp;nbsp; &amp;nbsp;#1.你想让你的这个项目跑在哪个端口 &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; server_name 47.94.76.91;&amp;nbsp; &amp;nbsp; &amp;nbsp;#2.当前服务器ip &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;location / { &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;root&amp;nbsp; &amp;nbsp;/home/dist/;&amp;nbsp; &amp;nbsp; &amp;nbsp;#3.dist文件的位置(我是直接放在home目录下了)&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; try_files $uri $uri/ /index.html;&amp;nbsp; &amp;nbsp; &amp;nbsp;#4.重定向,内部文件的指向(照写) &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;} &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; location /api {&amp;nbsp; #4.当请求跨域时配置端口转发 &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; proxy_pass http://47.92.76.97:8848/api; #5.转发地址 &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; }&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;} 跨域问题在这里着重说一下：这里的跨域配置是打包后，nginx做的代理转发。在开发模式的proxytable没有任何关系。如果nginx不进行跨域的配置，虽然项目部署了，但是服务根本就会访问不到关于跨域的介绍可以看我的另外一篇文章 https://blog.csdn.net/weixin_42565137/article/details/90578780三.开放端口像阿里云的服务器都需要开通端口才可以访问的。这个不做详细介绍。然后我们重启nginx就可以访问我们部署的项目了 service nginx restart————————————————版权声明：本文为CSDN博主「优雅的王德奥」的原创文章，遵循 CC 4.0 BY-SA 版权协议，转载请附上原文出处链接及本声明。原文链接：https://blog.csdn.net/weixin_42565137/article/details/90577950', NULL, '2020-01-07 06:21:07', 'admin', 1, 212, 2, 0, 'acca5da2-014a-4141-b9b5-21e5a66e043b.png');
