INSERT INTO `biz_article` VALUES (257, 5, '贾跃亭为什么现在还不回国？', '<p><strong>这其实是一个比较现实的问题，贾跃亭在中国背负的债务，可能会让他在回国后喘不过气来，而且他的所有房产已经被法院收押，他回国后要面临无家可归的境地。</strong>不知道从什么时候开始，贾跃亭三个字不再是中国优秀创业者和杰出企业家的代表，而成了一个梗，对，没错，就是一个梗，只要你在微博下面评论“贾跃亭回国”，大家对此都是一笑了之，那么很多人就疑惑了，说贾跃亭他到底什么时候回国呢？就在近日，有媒体发布消息称：贾跃亭被证监会立案了，理由是认为贾跃亭曾在乐事的时候有过违规违法的商业操作。于是就有人说：这下看来，已经离家600多天的贾跃亭<img src=\"data:image/jpeg;base64,\"></p><p>不得不回国了。</p><p>不过一转眼的功夫，就又有另一些人出来说，贾跃亭回国只是谣言，大家不要相信。那么问题来了，贾跃亭到底还会不会回国，为什么说他根本就不可能回国呢？我个人觉得，贾跃亭肯定不会回国的原因，有三点。第一点，假设贾跃亭真的是一个商业骗子，他的FF汽车只是一个用来骗钱的概念，那贾跃亭肯定‘不敢回国’。</p><p><br></p>', NULL, '2020-01-08 08:42:22', 'admin', 1, NULL, 2, 0, NULL);
