INSERT INTO `biz_article` VALUES (262, 4, '感人之旅再临！《紫罗兰永恒花园》剧场版将如期首映', '<p>根据外国媒体myanimelist提供的最新消息，由于京都动画下达了明确要求，《紫罗兰永恒花园外传》剧场版目前已经确定如期进行首映。</p><p><img src=\"https://ss0.baidu.com/6ONWsjip0QIZ8tyhnq/it/u=430863882,3514299428&amp;fm=173&amp;app=25&amp;f=JPG?w=640&amp;h=618&amp;s=E992EC1B518FC0ED10F8F0C80300F0B1\"></p><p>据悉，按照原计划，《紫罗兰永恒花园外传～永远与自动手记人偶～》将于8月在德国animagiC上进行全球首映，此次上映时间为8月3日至4日。本作将于9月6日在日本正式上映，放映时间长达两周。此外，电影发行商松竹株式会社的一位高管表示：此次剧场版在7月18日的火灾发生之前就已经全部完成。</p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>', NULL, '2020-01-10 08:57:58', 'admin', 1, 228, 2, 0, '88d7b0d0-d5e4-44b8-b12a-5d7d090e21fa.jpg');
