INSERT INTO `biz_article` VALUES (265, 4, '《紫罗兰永恒花园》外传剧场版还真是1月10日国内上映', '<p><img src=\"data:image/jpeg;base64,\"></p><p><br></p><p>之前我也发文说过《紫罗兰的永恒花园外传 永远与自动手记人偶》的电影国内要引进，上映档期是1月10日，不过之前官微一直没有发文，是小道消息……所以我也删文了，这一次官微终于发话，放出了官方的海报，还真是1月10日上映，看来小道消息，有的时候还挺准的，不过为了对观众负责，我还是删文之前的内容，等官微确定再发一次</p><blockquote>京阿尼大法好</blockquote><pre class=\"ql-syntax\" spellcheck=\"false\">我再给大家确认几个比较容易搞错的消息，一个，这是《外传》，而不是剧场版，只是它的公映模式是电影院上映，剧场版是剧场版，是另外一部还没有上映的剧场版，剧场版的内容应该是TV版《紫罗兰永恒花园》的续篇，而这部是相当于OVA一样的另外一个相对独立的故事，当然世界观是一样的；另外一部剧场版，上映的时间是2020年4月……日本上映，还没有上映。\n</pre><p><img src=\"data:image/jpeg;base64,\"></p><p><br></p><p><br></p><p>另一点就是，这并不是京阿尼火灾后第一部做好的作品，按照上映节点和京阿尼恢复工作的时间来看，应该是火灾前就已经完成制作的作品……真正的火灾后的第一部作品，应该是明年上映的《紫罗兰永恒花园剧场版》的作品，目前应该在紧急制作中，但这部剧场版应该之前也已经做了一部分了，没做完，真正的火灾后的第一部全新作目前应该还没有头绪……希望京阿尼的新生力量，能够继承京阿尼一如既往的美感。这部《外传》和明年新的剧场版，我都会第一时间和大家分享观赏的心得。</p>', NULL, '2020-01-10 09:40:52', 'admin', 1, 226, 2, 0, '17e49b6c-b882-4786-b335-1407ce13f50c.jfif');
