INSERT INTO `biz_article` VALUES (267, 4, '贾跃亭', '<iframe class=\"ql-video\" frameborder=\"0\" allowfullscreen=\"true\" src=\"http://video.cas.cn/masvod/public/2020/01/06/20200106_16f791272e3_r29_800k.mp4\"></iframe><p><br></p><blockquote>新闻周刊</blockquote><p>本周最热话题无疑是美团创始人王兴公开表示新势力未来只有3家存活，分别是蔚来、小鹏和理想。</p><p>对此威马汽车创始人沈晖表示“我不服”，并立下赌约：威马2020年销量进Top 3，王兴要亲自送一份外卖给沈晖，地点、时间不限，威马若没有完成目标，则沈晖买一辆车送给王兴，品牌、价格不限。</p><p>此外，各大车企亮出2019年成绩单也属实亮眼，卖的好的新势力也迫不及待在本周相继晒出了自己的2019年销量成绩单，销量惨淡的则毫无音讯。</p><p><img src=\"data:image/jpeg;base64,\"></p><blockquote class=\"ql-align-justify\">编者按：本文来自微信公众号“公开参考”（ID：gongkaicankao），作者 王金成，36氪经授权发布。</blockquote><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">去年10月，贾跃亭声称替乐视网还了30亿美金，如今又一次被打脸。</p><p class=\"ql-align-justify\">最近，乐视网因为6项违规行为，受到深交所纪律处分。</p><p class=\"ql-align-justify\">1月8日上午，乐视网董事长兼总经理刘延峰、董事武宝雨通过“互动易”平台，在线上公开致歉，也对涉及违规担保、资金链、债务等多项问题进行了回应。</p><p class=\"ql-align-justify\">他们表示：贾跃亭还的钱至今还一分没拿到。</p><p class=\"ql-align-justify\">眼看着恢复上市无望，有网友建议乐视网“卖壳”求生。</p><p class=\"ql-align-justify\">贾跃亭和孙宏斌违规，现任董事长出来道歉</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">2019年最后一天，深交所向乐视网下发了一份纪律处分决定。</p><p class=\"ql-align-justify\"><br></p><p><br></p>', NULL, '2020-01-13 06:50:12', 'admin', 1, 221, 2, 1, '8ac9f3e9-6147-495d-bc29-81317b27ba0b.jfif');
