INSERT INTO `biz_article` VALUES (273, 4, 'vue111', '<blockquote>Vue.js 教程</blockquote><p><img src=\"https://www.runoob.com/wp-content/uploads/2017/01/vue.png\" alt=\"Angular\">Vue.js（读音 /vjuː/, 类似于 view） 是一套构建用户界面的渐进式框架。</p><p>Vue 只关注视图层， 采用自底向上增量开发的设计。</p><p>Vue 的目标是通过尽可能简单的 API 实现响应的数据绑定和组合的视图组件。</p><p>Vue 学习起来非常简单，本教程基于 Vue 2.1.8 版本测试。</p><h2>阅读本教程前，您需要了解的知识：</h2><ul><li>HTML</li><li>CSS</li><li>JavaScript</li></ul><p>本教程主要介绍了 Vue2.x 版本的使用。</p><h2>第一个实例</h2><h2>Vue 2.0 Hello World</h2><p><br></p><pre class=\"ql-syntax\" spellcheck=\"false\">&lt;div id=\"app\"&gt; &lt;p&gt;{{ message }}&lt;/p&gt; &lt;/div&gt;\n</pre><p><br></p><p><a href=\"https://www.runoob.com/try/try.php?filename=vue2-hw\" rel=\"noopener noreferrer\" target=\"_blank\">尝试一下 »</a>点击 \"尝试一下\" 按钮查看在线实例</p><h2>参考资料：</h2><p>Webpack 入门教程：<a href=\"https://www.runoob.com/w3cnote/webpack-tutorial.html\" rel=\"noopener noreferrer\" target=\"_blank\">http://www.runoob.com/w3cnote/webpack-tutorial.html</a></p><p>官方文档：<a href=\"http://vuejs.org/v2/guide/syntax.html\" rel=\"noopener noreferrer\" target=\"_blank\">http://vuejs.org/v2/guide/syntax.html</a></p><p>中文文档: <a href=\"https://cn.vuejs.org/v2/guide/syntax.html\" rel=\"noopener noreferrer\" target=\"_blank\">https://cn.vuejs.org/v2/guide/syntax.html</a></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p><p><br></p>', NULL, '2020-01-14 10:01:56', 'admin', 1, 223, 2, 0, 'e9758057-7886-43da-83f2-e80fa0622b63.jpg');
INSERT INTO `biz_article` VALUES (274, 4, 'SpringBoot+vue+Iview前后端分离权限内容管理CMS系统', '<p><span style=\"color: rgb(0, 0, 0);\">hrcms</span></p><p><span style=\"color: rgb(0, 0, 0);\">基于springBoot框架的内容管理系统，采用最新最主流的技术，后端采用spring boot,mybatis-plus,freemaker，shiro，redis，mysql，等,主要功能：消息队列，权限控制，自定义栏目文章，扩展，内容管理，通用日志记录等。</span></p><p>鸣谢</p><p>MybatisPlus https://git.oschina.net/baomidou/mybatis-plus</p><p>各种中间件- -!</p><p>特点</p><p>免费完整开源：基于开源协议，源代码完全开源，无商业限制,开发者承诺将HRCMS内容系统永久完整开源</p><p>标签化建站：不需要专业的后台开发技能，只要使用系统提供的后台系统，就能轻松建设网站；</p><p>丰富插件：支持文章复杂排版</p><p>定期更新：承诺定期更新，分享更多好用等模版与插件；</p><p>文档丰富：为了让用户更快速的使用HRCms系统进行开发，作者持续更新开发相关文档，如标签文档、使用文档、视频教程等；</p><p>约定大于配置: 80%的中间集成配置 在后台系统中可视化配置 支持Redis、es、MongoDb、FastDFS、等等</p><p>松耦合： 后台权限管理系统与新闻模块松耦合 可以直接删除新闻模块单独使用</p><p>全文检索： 基于ES实现全站文章的全文快速检索</p><p>可视化数据：基于echarts和MongoDB 实现可视化海量数据的展示 二次开发成本低</p><p>面向对象</p><p>企 业：缺乏it技术帮助创立初期的公司或团队快速搭建产品的技术平台，加快公司项目开发进度；</p><p>开发者：帮助开发者快速完成承接外包的项目，避免从零搭建系统；</p><p>学习者：初学JAVA的同学可以下载源代码来进行学习交流；</p><p>开发环境</p><p>建议开发者使用以下环境，这样避免版本带来的问题</p><p>Windows、Linux</p><p>Eclipse、Idea</p><p>Mysql≧5.7</p><p>JDK≧8</p><p>Tomcat≧8</p><p>中间件请阅读项目中的项目搭建文档</p><p>技术交流</p><p>作者微信:Johnston</p><p>QQ:1261670412</p><p>后端截图</p><p><br></p><p>&nbsp;<img src=\"https://img2018.cnblogs.com/common/1893708/202002/1893708-20200207161812684-1000956307.png\"></p><p><br></p><p><img src=\"https://img2018.cnblogs.com/common/1893708/202002/1893708-20200207161919531-1038344061.png\"></p>', NULL, '2020-01-14 11:42:43', 'admin', 1, 244, 2, 0, '0434fbf9-3484-4fed-ad2b-5fa49ef9b9a0.png');
INSERT INTO `biz_article` VALUES (275, 4, '集团公司召开干部任职宣布会议', '<p><strong>本网讯</strong>（人力资源部：<strong>付志刚</strong>&nbsp;报道）8月28日，内蒙古机场集团召开干部任职宣布会议。会议宣布了首都机场集团决定：任命李洪为内蒙古机场集团公司党委书记，并聘任为内蒙古机场集团公司副总经理。首都机场集团公司党委副书记、纪委书记刘建红、人力资源部总经理陈鸿、审计监察部副总经理、纪检办公室副主任刘颖出席了会议，会议由内蒙古机场集团总经理、党委副书记陈建军的主持</p><p><img src=\"data:image/jpeg;base64,\"></p><p>&nbsp;<span style=\"color: rgb(0, 0, 0);\">李洪在会上作了任职表态发言。他表示将尽快进入角色加强学习调研，完成由业务工作向党务工作，由专业公司经营管理向机场管理的转变同时，将认真履行全面从严治党责任，全面加强党的建设，注重加强班子团结、队伍建设、廉政建设和作风建设；抓好巡查问题整改；充分调动广大干部员工干事创业的积极性，以高质量的党建推动内蒙古机场集团各项工作再上新台阶，创造新辉煌。</span></p>', NULL, '2020-01-15 02:41:42', 'admin', 1, 250, 2, 0, 'e8da7db9-a4fa-4343-b357-7ebad325ad71.png');
INSERT INTO `biz_article` VALUES (276, 4, 'mongoDb高性能存储', '<p>1.</p><p><span style=\"color: rgb(0, 0, 0);\">满足对数据库的高并发读写 </span></p><p>2.</p><p><span style=\"color: rgb(0, 0, 0);\">对海量数据的高效存储和访问 </span></p><ul><li>3.</li></ul><p><span style=\"color: rgb(0, 0, 0);\">对数据库高扩展性和高可用性</span></p>', NULL, '2020-01-15 06:53:18', 'admin', 1, 251, 2, 0, 'fda6c4b5-2267-4e13-8e00-feab91331051.jpg');
INSERT INTO `biz_article` VALUES (277, 4, '到底欠多少债？贾跃亭能还钱吗？乐视致歉会一一回应', '<h2>原标题：到底欠多少债？贾跃亭能还钱吗？乐视致歉会一一回应</h2><p>中新经纬客户端1月8日电 近日，<a href=\"http://finance.sina.com.cn/realstock/company/sz300104/nc.shtml\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(55, 83, 162);\">乐视网</a>(1.690,&nbsp;0.00,&nbsp;0.00%)受到深交所纪律处分。8日上午，在深圳证券交易所“互动易”平台举行的线上致歉会上，公司董事长兼总经理刘延峰、董事武宝雨就违规担保、资金链、员工工资、还债情况、未来打算等多项问题进行回应。</p><p class=\"ql-align-center\"><img src=\"http://n.sinaimg.cn/spider202018/95/w1151h544/20200108/cc81-imvsvyz8227691.jpg\" alt=\"乐视致歉会。截图来源：深交所互动易平台\"><strong>乐视致歉会。截图来源：深交所互动易平台</strong></p><p><strong>关于违规担保</strong></p><p><strong>问：乐视体育违规担保案会为什么会发生？为什么没有阻止？</strong></p><p>答：2015年时任管理层在未履行《公司法》、《公司章程》等法律法规规定的上市公司审批、审议、签署程序、乐视网未授权代理人签订合同背景下，作为签订合同人超越代理人权限签订合同，造成乐视体育、乐视云违规担保案。</p><p><strong>问：乐视体育违规担保未经股东大会批准是无效的，为何公司不去法院起诉？</strong></p><p>答：相关问题答案请详见公司于2019年5月15日在巨潮资讯网披露的公告《关于重大诉讼进展及重大风险提示的公告》。</p><p>（注：2018年11月北京市高级人民法院对哈尔滨工业大学高新技术产业开发股份有限公司违规担保案件作出判决，2019年1月上海市高级人民法院对广西慧金科技股份有限公司违规担保案件作出判决，均确定未经上市公司董事会、股东大会合法决议的债务、对外担保事项相关协议内容对上市公司不发生法律效力。）</p><p><strong>问：乐视体育担保案进展如何？</strong></p><p>答：截至2019年12月31日，乐视网违规对乐视体育担保案已经有乐视体育18方投资人对公司提起仲裁，其中14起仲裁案已经出具仲裁结果，其他4起仲裁案仍在审理过程中。</p><p><strong>问：贾跃亭的违规担保到底给乐视网带来多大的损失？</strong></p><p>答：乐视网2019年前三季度归属母公司净亏损101.94亿余元，<strong>其中因乐视体育、乐视云违规担保案件计提负债约98亿余元。</strong></p><p><strong>问：乐视体育、乐视云违规担保案会不会成为压死骆驼的最后一根稻草？</strong></p><p>答：2019年乐视网因乐视体育、乐视云违规担保案计提相关负债约98亿元，是公司在2019年前三季度巨额亏损、造成目前乐视网经营极度困难的主要原因。</p><p class=\"ql-align-center\"><img src=\"http://n.sinaimg.cn/spider202018/90/w540h350/20200108/8177-imvsvyz8227692.jpg\" alt=\"资料图。中新经纬 摄\"><strong>资料图。中新经纬 摄</strong></p><p><strong>关于乐视</strong></p><p><strong>问：目前公司在职员工多少名？</strong></p><p>答：根据2018年年度报告，公司在职员工数量是456名。<strong>2019年，公司大规模缩减人员费用，以缓解公司岌岌可危的经营情况，具体的员工人数将在2019年年度报告中披露。</strong></p><p><strong>问：员工的工资是否付的起？</strong></p><p>答：公司管理层一直在努力维持公司持续经营能力，<strong>员工工资短期内尚能维持。</strong></p><p><strong>问：乐视网现在还有什么业务？</strong></p><p>答：乐融致新出表后，与乐融致新有关的TV业务资产、负债、净利润及现金流量不纳入乐视网合并范围，但是乐视网原有的广告、会员及发行、技术服务等业务仍存续。</p><p><strong>问：乐视网现在还有收入吗？是不是快倒闭了？</strong></p><p>答：根据公司披露的2019年第三季度报告，上市公司合并范围内2019年前三季度共实现营业收入3.9亿元，公司管理层正在努力维持公司的持续经营能力。</p><p><strong>问：乐视网到底对外一共有多少负债？</strong></p><p>答：根据公司披露的2019年第三季度报告，截至2019年9月30日，上市公司合并范围内负债总额约217亿元，其中大股东及其实际控制企业对上市公司合并范围的欠款余额达到约20亿元，大股东贾跃亭导致的乐视体育、乐视云违规担保案致使公司计提负债约98亿元。</p><p><strong>问：关于乐视大厦被拍卖一案，目前因案外人对拍卖财产提出异议被中止，这是由乐视网提起的吗？</strong></p><p>答：乐视网属于大厦清退案件的案外人，对宏城鑫泰、中泰创展、韬蕴资本之间的纠纷我们并不了解。本次中止拍卖不是因乐视网对拍卖财产提出异议而中止。</p><p><strong>问：乐视网目前资金链会断吗？</strong></p><p>答：2019年以来公司管理层通过调整经营模式，提升运营效率，控制成本费用等措施，使公司日常运营成本、CDN费用、人力成本大幅下降，公司管理层正在努力维持公司的持续经营能力。</p><p><strong>问：乐融致新出表后乐视电视是否与乐视网无关联？</strong></p><p>答：乐视网现在为乐融致新第二大股东，上市公司与乐融致新在会员等方面的合作仍在进行中。</p><p><strong>问：网上说乐视的全部版权已经卖了是否属实？大部分版权已经卖了是否属实？</strong></p><p>答：<strong>（全部版权已卖）此说法并不属实。乐视网的版权有部分出售，</strong>具体情况请详见公司即将披露的《2019年年度报告》。</p><p><strong>问：2020年乐视网还有自制剧吗？</strong></p><p>答：乐视网原有的广告、会员及发行、技术服务等业务仍存续，其中影视剧发行业务为公司子公司花儿影视主营业务。</p><p><strong>问：今年发布的与漫威合作的乐视电视，跟乐视网有关系吗？漫威剧是否会在乐视视频上播？</strong></p><p>答：此次媒体报道乐视电视与漫威合作系上市公司参股公司乐融致新，与上市公司无直接关系。</p><p><strong>问：乐视视频会员还能看吗？</strong></p><p>答：可以的。</p><p><strong>问：2020年乐视网有何打算的？</strong></p><p>答：公司将努力维持持续经营能力，全力对关联方应收款项进行催收，同时公司将采取包括法律手段在内的一切方式维护股东利益，公司第一大股东贾跃亭因关联方资金占用、违规担保等事项对公司造成的损失，<strong>公司将继续坚持并依法向其追偿。</strong></p><p><strong>关于二级市场</strong></p><p><strong>问：这次乐视网因募集资金违规被罚，现在募集资金情况怎么样了？</strong></p><p>答：截至2017年12月31日，公司非公开发行募投项目已全部投出，由于目前公司募集资金专项账户被冻结，待冻结解除后公司将划转节余资金，对该募集资金专户进行销户处理，截至2019年9月30日，募集资金存放专项账户合计余额约15.77万元。</p><p><strong>问：证监会对乐视网的调查进度怎么样了？结果什么时候出来？</strong></p><p>答：目前证监会调查仍在进行当中，如有相关进展，公司将及时履行信息披露义务。</p><p><strong>问：为什么乐视网股票被暂停上市？</strong></p><p>答：因为公司 2018年度经审计归属于上市公司股东净资产为负，根据《深圳证券交易所创业板股票上市规则》13.1.1规定，公司股票被暂停上市。</p><p><strong>问：乐视网被暂停上市公司都做了什么努力恢复上市的工作？</strong></p><p>答：公司股票被暂停上市后，公司短期正常业务开展没有受到太大影响，公司管理层将工作重点放在业务恢复、控制成本、主张关联方债权、偿还债务上。2019年，管理层尽力调整经营模式，提升运营效率，控制成本费用，使日常运营成本、CDN费用、人力成本有了大幅下降。</p><p><strong>问：2020年公司能够满足恢复上市的条件吗？</strong></p><p>答：公司具体能否满足恢复上市条件还要看2019年度审计报告出来后的整体情况，目前还不确定，请投资者参考公司已发布的定期报告综合判断风险。</p><p><strong>问：恢复上市是要公司申请还是等深交所通知？</strong></p><p>答：如果公司达到恢复上市的条件，公司会向交易所提出恢复上市的申请。</p><p><strong>问：会退市吗？</strong></p><p>答：如若公司股票被交易所决定暂停上市后，公司出现《创业板上市规则》13.4.1规定相关情形，公司股票存在被终止上市的风险。</p><p><strong>问：乐视网如果从深交所退市，会退到哪里交易？</strong></p><p>答：如乐视网从深交所退市，乐视网股票将在全国中小企业股份转让系统进行挂牌转让。</p><p><strong>问：乐视网如果被退市，我的股票是不是就不能交易了？</strong></p><p>答：如乐视网股票被终止上市，乐视网将进入30个交易日的退市整理期，具体情况请详见《深圳证券交易所退市整理期业务特别规定》。</p><p><strong>问：会重组吗？</strong></p><p>答：公司目前没有增资、实施债务重组计划。</p><p><strong>问：现在创业板借壳上市被放开了，乐视网有卖壳的打算吗？</strong></p><p>答：乐视网目前没有重大资产重组计划。</p><p><strong>问：乐视网为什么换2019年审计机构了？</strong></p><p>答：因原负责公司审计业务的团队整体转入大华会计师事务所（特殊普通合伙），该业务团队执行的相关审计业务项目也一并由大华承接，为保障业务与服务的延续性，公司变更大华为公司2019年度财务报表及内部控制审计机构。</p><p><strong>问：2019年年报和2020年一季报计划什么时间出来？</strong></p><p>答：目前乐视网2019年年度报告的预约披露时间是2020年4月27日。</p><p><strong>关于贾跃亭</strong></p><p><strong>问：网上有消息说贾跃亭先生已替公司偿还债务超30亿美金，是真的吗？还了乐视多少？</strong></p><p>答：2018年8月至今，乐视网与贾跃亭及其关联方已经进行多次谈判，但由于解决方案的落地和执行依赖贾跃亭的处理意愿和实际执行，因此乐视网与贾跃亭及其关联方债务处理没有任何进展，<strong>截至目前，贾跃亭及其关联方债务处理小组未拿出可实质执行的完整处理方案，乐视网未因债务解决方案获得任何现金。</strong></p><p><strong>问：贾跃亭在国外，怎么配合证监会调查？</strong></p><p>答：此前据贾跃亭方面回复：贾跃亭将积极配合相关调查工作。如有相关进展，公司将及时履行信息披露义务。</p>', NULL, '2020-01-17 04:16:46', 'admin', 1, 252, 2, 0, 'c9d61c7d-e63c-4443-b9dd-7a0f276d5bdd.jpg');
