INSERT INTO `biz_article` VALUES (290, 4, '漫画图解Nginx反向代理', '<h2 class=\"ql-align-justify\">之前在面试的时候，在简历上写了Nginx。于是面试官就问我：“你用Nginx来做什么啊？”我当时候回答：“我用Nginx其实上就是做一个反向代理，将请求反向代理到Tomcat上。” 于是面试官就问：“那啥是反向代理啊？”(还好我那时刚好看过相关的知识点)。于是我就从正向代理开始介绍，再说回反向代理了(balabala...但最后面试我还是挂了)</h2><h2 class=\"ql-align-justify\">这篇文章讲得非常不错，建议阅读！</h2><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551773988764.png\" alt=\"img\"></p><p class=\"ql-align-justify\">周末，我正在网上搜索简历，准备给团队招聘新人。这时候，女朋友回来了，看起来并不是很高兴。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774002380.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774021580.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774031695.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><strong>反向代理（reverse proxy）：是指以代理服务器来接受internet上的连接请求，然后将请求转发给内部网络上的服务器，并将从服务器上得到的结果返回给internet上请求连接的客户端，此时代理服务器对外就表现为一个反向代理服务器。</strong></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774050678.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774061356.png\" alt=\"img\"></p><h3 class=\"ql-align-justify\"><strong>正向代理</strong></h3><p class=\"ql-align-justify\">正向代理（forward proxy）：是一个位于客户端和目标服务器之间的服务器(代理服务器)，为了从目标服务器取得内容，客户端向代理服务器发送一个请求并指定目标，然后代理服务器向目标服务器转交请求并将获得的内容返回给客户端。</p><p class=\"ql-align-justify\">这种代理其实在生活中是比较常见的，比如<strong>科学上网</strong>技术，其用到的就是代理技术。</p><p class=\"ql-align-justify\">有时候，用户想要访问某国外网站，该网站无法在国内直接访问，但是我们可以访问到一个代理服务器，这个代理服务器可以访问到这个国外网站。这样呢，用户对该国外网站的访问就需要通过代理服务器来转发请求，并且该代理服务器也会将请求的响应再返回给用户。这个上网的过程就是用到了正向代理。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774073934.png\" alt=\"img\"></p><p class=\"ql-align-justify\">这个过程其实和租房子很像。</p><p class=\"ql-align-justify\">租房子的时候，一般情况下，我们很难联系到房东，因为有些房东为了图方便，只把自己的房屋信息和钥匙交给中介了。而房客想要租房子，只能通过中介才能联系到房东。而对于房东来说，他可能根本不知道真正要租他的房子的人是谁，他只知道是中介在联系他。</p><p class=\"ql-align-justify\">这里面一共有三个角色，租客（用户）、中介（代理服务器）和房东（国外网站，目标服务器）。引入中介（代理服务器）的原因是用户无法联系上房东（用户无法访问国外网站）。</p><p class=\"ql-align-justify\"><strong>所以，正向代理，其实是\"代理服务器\"代理了\"客户端\"，去和\"目标服务器\"进行交互。</strong></p><p class=\"ql-align-justify\">通过正向代理服务器访问目标服务器，目标服务器是不知道真正的客户端是谁的，甚至不知道访问自己的是一个代理（有时候中介也直接冒充租客）。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774138812.png\" alt=\"img\"></p><h3 class=\"ql-align-justify\"><strong>正向代理的用途</strong></h3><p class=\"ql-align-justify\"><strong>突破访问限制</strong></p><p class=\"ql-align-justify\">通过代理服务器，可以突破自身IP访问限制，访问国外网站，教育网等。</p><p class=\"ql-align-justify\">即，租客可以通过中介，来解决无法联系上房东的问题。</p><p class=\"ql-align-justify\"><strong>提高访问速度</strong></p><p class=\"ql-align-justify\">通常代理服务器都设置一个较大的硬盘缓冲区，会将部分请求的响应保存到缓冲区中，当其他用户再访问相同的信息时， 则直接由缓冲区中取出信息，传给用户，以提高访问速度。</p><p class=\"ql-align-justify\">即，中介手里留存了很多房源信息和钥匙，可以直接带租客去看房。</p><p class=\"ql-align-justify\"><strong>隐藏客户端真实IP</strong></p><p class=\"ql-align-justify\">上网者也可以通过这种方法隐藏自己的IP，免受攻击。</p><p class=\"ql-align-justify\">即，房东并不知道租客的真实身份。PS：但是中介知道了，可能骚扰更多….</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774154796.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774169931.png\" alt=\"img\"></p><h3 class=\"ql-align-justify\"><strong>反向代理</strong></h3><p class=\"ql-align-justify\">反向代理（reverse proxy）：是指以代理服务器来接受internet上的连接请求，然后将请求转发给内部网络上的服务器，并将从服务器上得到的结果返回给internet上请求连接的客户端，此时代理服务器对外就表现为一个反向代理服务器。</p><p class=\"ql-align-justify\">我们在租房子的过程中，除了有些房源需要通过中介以外，还有一些是可以直接通过房东来租的。用户直接找到房东租房的这种情况就是我们不使用代理直接访问国内的网站的情况。</p><p class=\"ql-align-justify\">还有一种情况，就是<strong>我们以为我们接触的是房东，其实有时候也有可能并非房主本人，有可能是他的亲戚、朋友，甚至是二房东</strong>。但是我们并不知道和我们沟通的并不是真正的房东。这种帮助真正的房主租房的二房东其实就是反向代理服务器。这个过程就是反向代理。</p><p class=\"ql-align-justify\">对于常用的场景，就是我们在Web开发中用到的负载均衡服务器（二房东），客户端（租客）发送请求到负载均衡服务器（二房东）上，负载均衡服务器（二房东）再把请求转发给一台真正的服务器（房东）来执行，再把执行结果返回给客户端（租客）。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774264629.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><strong>所以，反向代理，其实是\"代理服务器\"代理了\"目标服务器\"，去和\"客户端\"进行交互。</strong></p><p class=\"ql-align-justify\">通过反向代理服务器访问目标服务器时，客户端是不知道真正的目标服务器是谁的，甚至不知道自己访问的是一个代理。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774321602.png\" alt=\"img\"></p><h3 class=\"ql-align-justify\"><strong>反向代理的用途</strong></h3><p class=\"ql-align-justify\"><strong>隐藏服务器真实IP</strong></p><p class=\"ql-align-justify\">使用反向代理，可以对客户端隐藏服务器的IP地址。</p><p class=\"ql-align-justify\">即，租客并不房东知道的真实身份。</p><p class=\"ql-align-justify\"><strong>负载均衡</strong></p><p class=\"ql-align-justify\">反向代理服务器可以做<a href=\"http://mp.weixin.qq.com/s?__biz=Mzg3MjA4MTExMw==&amp;mid=2247484661&amp;idx=2&amp;sn=03f3a7ec83599a31a1d638869b785597&amp;chksm=cef5f743f9827e553b3923708ab4a00e990d0750759e81f3adf7261647a9191f6a5a0b878d12&amp;scene=21#wechat_redirect\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 238);\">负载均衡</a>，根据所有真实服务器的负载情况，将客户端请求分发到不同的真实服务器上。</p><p class=\"ql-align-justify\">即，二房东发现房主本人很忙，于是找到房主的妻子帮忙处理租房事宜。</p><p class=\"ql-align-justify\"><strong>提高访问速度</strong></p><p class=\"ql-align-justify\">反向代理服务器可以对于静态内容及短时间内有大量访问请求的动态内容提供缓存服务，提高访问速度。</p><p class=\"ql-align-justify\">即，二房东同样有房屋信息和钥匙。</p><p class=\"ql-align-justify\"><strong>提供安全保障</strong></p><p class=\"ql-align-justify\">反向代理服务器可以作为应用层防火墙，为网站提供对基于Web的攻击行为（例如DoS/DDoS）的防护，更容易排查恶意软件等。还可以为后端服务器统一提供加密和SSL加速（如SSL终端代理），提供HTTP访问认证等。</p><p class=\"ql-align-justify\">即，二房东可以有效的保护房东的安全。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774365936.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774375012.png\" alt=\"img\"></p><h3 class=\"ql-align-justify\"><strong>正向代理和反向代理的区别</strong></h3><p class=\"ql-align-justify\">虽然正向代理服务器和反向代理服务器所处的位置都是客户端和真实服务器之间，所做的事情也都是把客户端的请求转发给服务器，再把服务器的响应转发给客户端，但是二者之间还是有一定的差异的。</p><p class=\"ql-align-justify\">1、<strong>正向代理其实是客户端的代理</strong>，帮助客户端访问其无法访问的服务器资源。<strong>反向代理则是服务器的代理</strong>，帮助服务器做负载均衡，安全防护等。</p><p class=\"ql-align-justify\">2、<strong>正向代理一般是客户端架设的</strong>，比如在自己的机器上安装一个代理软件。而<strong>反向代理一般是服务器架设的</strong>，比如在自己的机器集群中部署一个反向代理服务器。</p><p class=\"ql-align-justify\">3、<strong>正向代理中，服务器不知道真正的客户端到底是谁</strong>，以为访问自己的就是真实的客户端。而在<strong>反向代理中，客户端不知道真正的服务器是谁</strong>，以为自己访问的就是真实的服务器。</p><p class=\"ql-align-justify\">4、正向代理和反向代理的作用和目的不同。<strong>正向代理主要是用来解决访问限制问题。而反向代理则是提供负载均衡、安全防护等作用。二者均能提高访问速度。</strong></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774390997.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774399223.png\" alt=\"img\"></p>', NULL, '2020-04-11 04:12:05', 'admin', 1, 248, 2, 0, 'cede8a2c-be60-49c5-85c0-f262cad5f1b5.jpg');
INSERT INTO `biz_article` VALUES (291, 4, 'nginx1', '<p><span style=\"color: rgb(56, 72, 90);\">版权</span>&nbsp;本着开源共享、共同学习的精神，本文转载自 NULL ，版权归 漫话编程 所有，如果侵权之处，请联系博主进行删除，谢谢~</p><p class=\"ql-align-justify\">之前在面试的时候，在简历上写了Nginx。于是面试官就问我：“你用Nginx来做什么啊？”我当时候回答：“我用Nginx其实上就是做一个反向代理，将请求反向代理到Tomcat上。” 于是面试官就问：“那啥是反向代理啊？”(还好我那时刚好看过相关的知识点)。于是我就从正向代理开始介绍，再说回反向代理了(balabala...但最后面试我还是挂了)</p><p class=\"ql-align-justify\">这篇文章讲得非常不错，建议阅读！</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551773988764.png\" alt=\"img\"></p><p class=\"ql-align-justify\">周末，我正在网上搜索简历，准备给团队招聘新人。这时候，女朋友回来了，看起来并不是很高兴。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774002380.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774021580.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774031695.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><strong>反向代理（reverse proxy）：是指以代理服务器来接受internet上的连接请求，然后将请求转发给内部网络上的服务器，并将从服务器上得到的结果返回给internet上请求连接的客户端，此时代理服务器对外就表现为一个反向代理服务器。</strong></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774050678.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774061356.png\" alt=\"img\"></p><h3 class=\"ql-align-justify\"><strong>正向代理</strong></h3><p class=\"ql-align-justify\">正向代理（forward proxy）：是一个位于客户端和目标服务器之间的服务器(代理服务器)，为了从目标服务器取得内容，客户端向代理服务器发送一个请求并指定目标，然后代理服务器向目标服务器转交请求并将获得的内容返回给客户端。</p><p class=\"ql-align-justify\">这种代理其实在生活中是比较常见的，比如<strong>科学上网</strong>技术，其用到的就是代理技术。</p><p class=\"ql-align-justify\">有时候，用户想要访问某国外网站，该网站无法在国内直接访问，但是我们可以访问到一个代理服务器，这个代理服务器可以访问到这个国外网站。这样呢，用户对该国外网站的访问就需要通过代理服务器来转发请求，并且该代理服务器也会将请求的响应再返回给用户。这个上网的过程就是用到了正向代理。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774073934.png\" alt=\"img\"></p><p class=\"ql-align-justify\">这个过程其实和租房子很像。</p><p class=\"ql-align-justify\">租房子的时候，一般情况下，我们很难联系到房东，因为有些房东为了图方便，只把自己的房屋信息和钥匙交给中介了。而房客想要租房子，只能通过中介才能联系到房东。而对于房东来说，他可能根本不知道真正要租他的房子的人是谁，他只知道是中介在联系他。</p><p class=\"ql-align-justify\">这里面一共有三个角色，租客（用户）、中介（代理服务器）和房东（国外网站，目标服务器）。引入中介（代理服务器）的原因是用户无法联系上房东（用户无法访问国外网站）。</p><p class=\"ql-align-justify\"><strong>所以，正向代理，其实是\"代理服务器\"代理了\"客户端\"，去和\"目标服务器\"进行交互。</strong></p><p class=\"ql-align-justify\">通过正向代理服务器访问目标服务器，目标服务器是不知道真正的客户端是谁的，甚至不知道访问自己的是一个代理（有时候中介也直接冒充租客）。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774138812.png\" alt=\"img\"></p><h3 class=\"ql-align-justify\"><strong>正向代理的用途</strong></h3><p class=\"ql-align-justify\"><strong>突破访问限制</strong></p><p class=\"ql-align-justify\">通过代理服务器，可以突破自身IP访问限制，访问国外网站，教育网等。</p><p class=\"ql-align-justify\">即，租客可以通过中介，来解决无法联系上房东的问题。</p><p class=\"ql-align-justify\"><strong>提高访问速度</strong></p><p class=\"ql-align-justify\">通常代理服务器都设置一个较大的硬盘缓冲区，会将部分请求的响应保存到缓冲区中，当其他用户再访问相同的信息时， 则直接由缓冲区中取出信息，传给用户，以提高访问速度。</p><p class=\"ql-align-justify\">即，中介手里留存了很多房源信息和钥匙，可以直接带租客去看房。</p><p class=\"ql-align-justify\"><strong>隐藏客户端真实IP</strong></p><p class=\"ql-align-justify\">上网者也可以通过这种方法隐藏自己的IP，免受攻击。</p><p class=\"ql-align-justify\">即，房东并不知道租客的真实身份。PS：但是中介知道了，可能骚扰更多….</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774154796.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774169931.png\" alt=\"img\"></p><h3 class=\"ql-align-justify\"><strong>反向代理</strong></h3><p class=\"ql-align-justify\">反向代理（reverse proxy）：是指以代理服务器来接受internet上的连接请求，然后将请求转发给内部网络上的服务器，并将从服务器上得到的结果返回给internet上请求连接的客户端，此时代理服务器对外就表现为一个反向代理服务器。</p><p class=\"ql-align-justify\">我们在租房子的过程中，除了有些房源需要通过中介以外，还有一些是可以直接通过房东来租的。用户直接找到房东租房的这种情况就是我们不使用代理直接访问国内的网站的情况。</p><p class=\"ql-align-justify\">还有一种情况，就是<strong>我们以为我们接触的是房东，其实有时候也有可能并非房主本人，有可能是他的亲戚、朋友，甚至是二房东</strong>。但是我们并不知道和我们沟通的并不是真正的房东。这种帮助真正的房主租房的二房东其实就是反向代理服务器。这个过程就是反向代理。</p><p class=\"ql-align-justify\">对于常用的场景，就是我们在Web开发中用到的负载均衡服务器（二房东），客户端（租客）发送请求到负载均衡服务器（二房东）上，负载均衡服务器（二房东）再把请求转发给一台真正的服务器（房东）来执行，再把执行结果返回给客户端（租客）。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774264629.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><strong>所以，反向代理，其实是\"代理服务器\"代理了\"目标服务器\"，去和\"客户端\"进行交互。</strong></p><p class=\"ql-align-justify\">通过反向代理服务器访问目标服务器时，客户端是不知道真正的目标服务器是谁的，甚至不知道自己访问的是一个代理。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774321602.png\" alt=\"img\"></p><h3 class=\"ql-align-justify\"><strong>反向代理的用途</strong></h3><p class=\"ql-align-justify\"><strong>隐藏服务器真实IP</strong></p><p class=\"ql-align-justify\">使用反向代理，可以对客户端隐藏服务器的IP地址。</p><p class=\"ql-align-justify\">即，租客并不房东知道的真实身份。</p><p class=\"ql-align-justify\"><strong>负载均衡</strong></p><p class=\"ql-align-justify\">反向代理服务器可以做<a href=\"http://mp.weixin.qq.com/s?__biz=Mzg3MjA4MTExMw==&amp;mid=2247484661&amp;idx=2&amp;sn=03f3a7ec83599a31a1d638869b785597&amp;chksm=cef5f743f9827e553b3923708ab4a00e990d0750759e81f3adf7261647a9191f6a5a0b878d12&amp;scene=21#wechat_redirect\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(0, 0, 238);\">负载均衡</a>，根据所有真实服务器的负载情况，将客户端请求分发到不同的真实服务器上。</p><p class=\"ql-align-justify\">即，二房东发现房主本人很忙，于是找到房主的妻子帮忙处理租房事宜。</p><p class=\"ql-align-justify\"><strong>提高访问速度</strong></p><p class=\"ql-align-justify\">反向代理服务器可以对于静态内容及短时间内有大量访问请求的动态内容提供缓存服务，提高访问速度。</p><p class=\"ql-align-justify\">即，二房东同样有房屋信息和钥匙。</p><p class=\"ql-align-justify\"><strong>提供安全保障</strong></p><p class=\"ql-align-justify\">反向代理服务器可以作为应用层防火墙，为网站提供对基于Web的攻击行为（例如DoS/DDoS）的防护，更容易排查恶意软件等。还可以为后端服务器统一提供加密和SSL加速（如SSL终端代理），提供HTTP访问认证等。</p><p class=\"ql-align-justify\">即，二房东可以有效的保护房东的安全。</p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774365936.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774375012.png\" alt=\"img\"></p><h3 class=\"ql-align-justify\"><strong>正向代理和反向代理的区别</strong></h3><p class=\"ql-align-justify\">虽然正向代理服务器和反向代理服务器所处的位置都是客户端和真实服务器之间，所做的事情也都是把客户端的请求转发给服务器，再把服务器的响应转发给客户端，但是二者之间还是有一定的差异的。</p><p class=\"ql-align-justify\">1、<strong>正向代理其实是客户端的代理</strong>，帮助客户端访问其无法访问的服务器资源。<strong>反向代理则是服务器的代理</strong>，帮助服务器做负载均衡，安全防护等。</p><p class=\"ql-align-justify\">2、<strong>正向代理一般是客户端架设的</strong>，比如在自己的机器上安装一个代理软件。而<strong>反向代理一般是服务器架设的</strong>，比如在自己的机器集群中部署一个反向代理服务器。</p><p class=\"ql-align-justify\">3、<strong>正向代理中，服务器不知道真正的客户端到底是谁</strong>，以为访问自己的就是真实的客户端。而在<strong>反向代理中，客户端不知道真正的服务器是谁</strong>，以为自己访问的就是真实的服务器。</p><p class=\"ql-align-justify\">4、正向代理和反向代理的作用和目的不同。<strong>正向代理主要是用来解决访问限制问题。而反向代理则是提供负载均衡、安全防护等作用。二者均能提高访问速度。</strong></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774390997.png\" alt=\"img\"></p><p class=\"ql-align-justify\"><img src=\"http://image.moguit.cn/1551774399223.png\" alt=\"img\"></p>', NULL, '2020-04-11 06:00:33', 'admin', 1, NULL, 2, 0, NULL);
